"use strict";

(function () {
    angular.module("support-page")
        .factory("UserGuide", function () {
            var topics = [
                {
                    key: "introduction",
                    title: "Chorus Introduction",
                    subtopics: [{
                        "title": "Overview",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Computing platforms that facilitate the sharing and analysis of scientific data represent an important and largely unmet need for many data-rich areas of science. This is especially true for mass spectrometry (MS)-based research areas (e.g. proteomics and metabolomics), where the current reliance on in-house data analysis solutions severely limits the ability to store, share, and re-use much of the existing data.</span><span>&nbsp;</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Chorus provides end-to-end workflow and data management system, guiding the user through the complexities of data analysis, allowing for the flexibility to iteratively refine hypothesis to derive insights.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 352.07px;\"><img alt=\"\" src=\"user-guide-images/image62.png\" style=\"width: 624.00px; height: 352.07px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "Chorus Design Principles",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Goal is to provide end-to-end workflow and data management system, guiding the user through the complexities of data processing and analysis steps, allowing for the flexibility to iteratively refine hypothesis to derive insights. We can logically break workflow on three system frameworks: </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_list_3-0 start\"><li class=\"c1 c36 c23\"><span class=\"c5\">Experiment design and data management. It’s needs to be handled generally for all instrument types;</span></li><li class=\"c1 c36 c23\"><span class=\"c5\">Data QC and raw data processing. It can be specific for a particular instrument and sample preparation method;</span></li><li class=\"c1 c36 c23\"><span class=\"c5\">Downstream analysis and biology mining (e.g., statistical analysis, pathway analysis, etc.)</span></li></ul><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 337.53px;\"><img alt=\"\" src=\"user-guide-images/image61.png\" style=\"width: 624.00px; height: 337.53px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "Chorus Integrative Platform",
                        "content": "<p class=\"c1 c12\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 690.67px; height: 389.33px;\"><img alt=\"\" src=\"user-guide-images/image192.png\" style=\"width: 690.67px; height: 389.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }]
                },
                {
                    key: "users-roles-labaratory-management",
                    title: "Users, roles, and laboratory management",
                    subtopics: [{
                        "title": "Users and roles",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><a id=\"t.cf99bc5a909b0df5d1a29e709ad2f6a87d14267a\"></a><a id=\"t.0\"></a><table class=\"c54\"><tbody><tr class=\"c47\"><td class=\"c32\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">Role</span></p></td><td class=\"c35\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">Permissions</span></p></td><td class=\"c43\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">Description</span></p></td></tr><tr class=\"c47\"><td class=\"c32\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">Regular User</span></p></td><td class=\"c35\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">- View public data and shared with the user including experiment designs, raw data processing results from workflows, and &nbsp;analysis results from downstream analysis pipelines;</span></p><p class=\"c2\"><span class=\"c5\">- Download public data including raw data, processed data, analysis results from downstream analysis;</span></p></td><td class=\"c43\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">Any person authenticated by the system can be a “regular” user. User authentication can be done directly by Chorus or via corporate SSO system integration. SSO integration can be done view professional services.</span></p></td></tr><tr class=\"c47\"><td class=\"c32\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">Lab User</span></p></td><td class=\"c35\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">- Regular user permissions;</span></p><p class=\"c2\"><span class=\"c5\">- Create new instruments;</span></p><p class=\"c2\"><span class=\"c5\">- View and download data generated by the lab;</span></p><p class=\"c2\"><span class=\"c5\">- Create projects and experiments and own them;</span></p><p class=\"c2\"><span class=\"c5\">- Process own experiments using workflows;</span></p></td><td class=\"c43\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">User can apply for membership of a &nbsp;laboratory during registration or by modifying “My Profile”. User can be member of multiple laboratories. Lab head should approve user as a member of the laboratory. Newly created instruments by a “lab user” should be approved by the lab head. User who created an instrument will automatically become an “instrument operator”.</span></p></td></tr><tr class=\"c47\"><td class=\"c32\" colspan=\"1\" rowspan=\"1\"><p class=\"c2 c4\"><span class=\"c5\"></span></p></td><td class=\"c35\" colspan=\"1\" rowspan=\"1\"><p class=\"c2 c4\"><span class=\"c5\"></span></p></td><td class=\"c43\" colspan=\"1\" rowspan=\"1\"><p class=\"c2 c4\"><span class=\"c5\"></span></p></td></tr><tr class=\"c47\"><td class=\"c32\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">Lab Head</span></p></td><td class=\"c35\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">- Lab user permissions;</span></p><p class=\"c2\"><span class=\"c5\">- Instrument operator permissions for all instruments in the lab;</span></p><p class=\"c2\"><span class=\"c5\">- Manages all users, permissions, and data within the lab;</span></p><p class=\"c2\"><span class=\"c5\">- Owns all the data for users who departed from the lab;</span></p><p class=\"c2\"><span class=\"c5\">- Approves users and instruments;</span></p></td><td class=\"c43\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">There is only one “lab head” for a lab. Lab head is responsible for everything in the lab including users, instruments, and data. </span></p></td></tr><tr class=\"c47\"><td class=\"c32\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">System Administrator</span></p></td><td class=\"c35\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">- Regular user permissions;</span></p><p class=\"c2\"><span class=\"c5\">- Approves new labs;</span></p><p class=\"c2\"><span class=\"c5\">- Manages labs and users;</span></p><p class=\"c2\"><span class=\"c5\">- Monitors all processing runs executed by all labs;</span></p><p class=\"c2\"><span class=\"c5\">- Monitor cloud resources used by each lab; </span></p><p class=\"c2 c4\"><span class=\"c5\"></span></p></td><td class=\"c43\" colspan=\"1\" rowspan=\"1\"><p class=\"c2\"><span class=\"c5\">Main goal of this role is managing labs and users. In addition, system administrator can monitor workflow executions and how, how much data is owned by each lab, and used computational resources for data processing and analysis per each lab. Chorus can have multiple system administrators.</span></p></td></tr></tbody></table><h3 class=\"c24 c25\" id=\"h.6joxslivu7sm\"><span class=\"c13 c9 c38\"></span></h3><hr style=\"page-break-before:always;display:none;\"><h3 class=\"c24 c25\" id=\"h.z4ewfjdmjgo6\"><span class=\"c13 c9 c38\"></span></h3>"
                    }, {
                        "title": "Forgot Your Password?",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c48\"><span class=\"c5\">To reset your password:<br></span></p><ol class=\"c10 lst-kix_872vsari60ae-0 start\" start=\"1\"><li class=\"c1 c36 c23\"><span class=\"c5\">Go to the Sign in page and select \"Forgot your password?\"; </span></li><li class=\"c1 c36 c23\"><span class=\"c5\">Confirm your email in the opened form and click “Send Instructions”;</span></li><li class=\"c1 c36 c23\"><span class=\"c5\">Check your inbox for an email and follow the link to set a new password for your account. From there, you will be directed to create a new password.</span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Managing User Profile",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To manage your profile use drop down menu in the top-right.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Click on your name and select “My Profile”. &nbsp;It will bring a multi-tab dialog where you can change your general information, add laboratories, change your password and email. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_4gvzdjgpuycv-0 start\" start=\"1\"><li class=\"c1 c36 c23\"><span class=\"c9\">General</span><span>&nbsp;tab: Here you can change your Name, Last Name and </span><span class=\"c45\"><a class=\"c6\" href=\"#h.4y12bawet5ds\">Add Laboratories</a></span><span class=\"c5\">.<br></span></li></ol><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 471.00px; height: 429.04px;\"><img alt=\"\" src=\"user-guide-images/image89.png\" style=\"width: 471.00px; height: 429.04px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\"><br><br><br></span></p><ol class=\"c10 lst-kix_4gvzdjgpuycv-0\" start=\"2\"><li class=\"c1 c36 c23\"><span class=\"c9\">Change Password</span><span class=\"c5\">&nbsp;tab. Provides you with ability to change your password instantly.</span></li></ol><p class=\"c27 c15\"><span><br><br></span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 477.93px; height: 297.50px;\"><img alt=\"\" src=\"user-guide-images/image164.png\" style=\"width: 477.93px; height: 297.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>3. &nbsp;</span><span class=\"c9\">Change Email</span><span>&nbsp;tab. Use this tab in case you want to change your Email. <br><br></span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 577.50px; height: 331.00px;\"><img alt=\"\" src=\"user-guide-images/image125.png\" style=\"width: 577.50px; height: 331.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Laboratory management",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Laboratory creation is optional but you must belong to a lab on Chorus if you want to upload your own mass spectrometry data.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Become A Member Of A Laboratory",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To be affiliated with existing laboratory, go to “My Profile”. On a “General” tab you can easily request for membership:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_7ubdfe8d2kdy-0 start\" start=\"1\"><li class=\"c1 c17\"><span class=\"c5\">Type the first few letters of the name of your lab in a relevant field;</span></li><li class=\"c1 c17\"><span class=\"c5\">Click “Save” button to proceed;</span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Your request for membership will be sent to the Lab Head for approval. </span></p><p class=\"c1 c15\"><span class=\"c5\">Once your request is considered you will be notified of the Lab Head’s decision by email. </span></p><p class=\"c1 c15\"><span class=\"c5\">You will be able to see data managed within the laboratory after request is approved.</span></p>"
                    }, {
                        "title": "Send Request For Laboratory Creation",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">If you can’t find your laboratory in the list, you can send a request for laboratory creation:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_u7w1r3vefhcp-0 start\" start=\"1\"><li class=\"c1 c17\"><span>Click “</span><span class=\"c45\"><a class=\"c6\" href=\"https://www.google.com/url?q=https://chorusproject.org/pages/laboratory-request.html&amp;sa=D&amp;ust=1531832129857000\">Can't find your laboratory in the list?</a></span><span class=\"c5\">” link, it will open a Request Laboratory Creation dialog; </span></li><li class=\"c1 c17\"><span class=\"c5\">Fill in all required fields: provide valid institution URL, laboratory name, your email address, specify the Lab Head; </span></li><li class=\"c1 c17\"><span class=\"c5\">Click “Send”. </span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">You will be notified by email when your request is processed by System Administrator. </span></p>"
                    }, {
                        "title": "To Monitor Status Of Your Request",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Go to “My Profile”, in the Laboratory field you’ll see the title of recently added laboratory. If the status is “pending” then the Lab Head or System Administrator didn’t approve it yet. &nbsp; </span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 468.50px; height: 206.00px;\"><img alt=\"\" src=\"user-guide-images/image101.png\" style=\"width: 468.50px; height: 206.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "Laboratory Creation",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">If you are the Lab Head you can create a laboratory by yourself: </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_309fhfpfpz1e-0 start\" start=\"1\"><li class=\"c0\"><span>Click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 96.00px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image42.png\" style=\"width: 96.00px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button in the top-left. In the drop-down menu select Laboratory;</span></li><li class=\"c0\"><span class=\"c5\">Fill in all mandatory fields;</span></li><li class=\"c0\"><span class=\"c5\">Click “Save” button. <br></span></li></ol><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 542.22px; height: 571.50px;\"><img alt=\"\" src=\"user-guide-images/image58.png\" style=\"width: 542.22px; height: 571.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">This request will be sent to System Administrator for approval. &nbsp; </span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Chorus Billing",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Each Lab created on Chorus automatically given a Free Plan (Free Storage Account). Depending on goal of using Chorus, Lab Head can select a subscription plan whichever is suitable to the Lab needs.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Four fee-based services for your Lab are offered: Active Storage, Archive Storage, Support for Processing Services, CPU Costs to Run Pipelines. System charges your Lab automatically every day according to features members of your laboratory used. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Active Storage</span><span class=\"c5\">&nbsp;provides high-speed access to data that is needed for viewers and other tools that perform real time data analysis or visualization. Active Storage is designed for data that is being used or analyzed and needs to be available on-demand. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Archive Storage</span><span class=\"c5\">&nbsp;provides a low cost option for storing data that does not require fast on-demand access. Data stored with the Archive Storage service can take several hours to access. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Support for Processing Services.</span><span class=\"c5\">&nbsp;Processing pipelines incur a support burden. &nbsp;To offset some of this burden, each lab using the processing capabilities must pay a support cost to have access to processing pipelines. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">CPU Costs to Run Pipelines managed on Chorus </span><span>is</span><span class=\"c9\">&nbsp;</span><span class=\"c5\">charged per CPU hour depending on pipeline.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 577.50px; height: 174.92px;\"><img alt=\"\" src=\"user-guide-images/image119.png\" style=\"width: 577.50px; height: 174.92px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c27 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5 c57\"></span></p>"
                    }, {
                        "title": "Chorus Accounts",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Chorus subscription is basically free. However, if you want advanced facilities, there are nominal charges that come with the plan. There are 2 account types on Chorus and it’s totally up to you which of them to choose for your needs:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_9i0fsrrkqivj-0 start\"><li class=\"c1 c36 c23\"><span class=\"c9\">Free Storage Account.</span><span class=\"c5\">&nbsp;It's a great choice if you don't have big data. You can place up to 100GB of data into Chorus Active Storage, share it with collaborators or make it public.</span></li><li class=\"c1 c36 c23\"><span class=\"c9\">Enterprise Storage Account.</span><span class=\"c5\">&nbsp;This choice will work best for you if you have more than 100 GB of data. You can also archive your data files in Chorus to save storage space and money.</span></li></ul><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Free Storage Account",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">This is the basic package which is absolutely free. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Features:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_xbsho6d3ghu3-0 start\"><li class=\"c0\"><span class=\"c5\">Labs can place up to 100 GB of raw data into Chorus Active Storage for free, share with collaborators, and it make public;</span></li><li class=\"c0\"><span>Lab Head</span><span>&nbsp;has an ability to enable Processing featur</span><span>e</span><span>; &nbsp;</span></li><li class=\"c0\"><span class=\"c5\">Labs with Free Storage Account are not able to archive data files stored on Chorus;</span></li></ul>"
                    }, {
                        "title": "Enterprise Storage Account",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Enterprise plan comes up with some advanced features. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Features:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_7t3rp4377cd9-0 start\"><li class=\"c0\"><span class=\"c5\">Labs can place more than 100GB of data into Chorus, share with collaborators, and make it public; &nbsp;</span></li><li class=\"c0\"><span class=\"c5\">Labs are able to switch to the Enterprise Account at any time, even if it does not have more than 100GB on the Active Storage;</span></li><li class=\"c0\"><span class=\"c5\">Labs can archive data files stored in Chorus (Only raw data will be archived. Translation data will remain on the Active Storage);</span></li></ul><p class=\"c1\"><span class=\"c5\">How it works:</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_38bz0drsl7sm-0 start\"><li class=\"c1 c22\"><span class=\"c5\">If Lab does not use Archive Storage and has less than 100GB on the Active Storage, then the Lab will not be charged; </span></li><li class=\"c1 c22\"><span class=\"c5\">If the Lab reaches 100GB limit, than the Lab is charged for 40$ for each 500 GB chunk per month. There is an additional $40 for each 500GB the Lab achieves. So a Lab with 500GB and 1 byte of data would get charged $80/month to cover their storage. </span></li><li class=\"c1 c22\"><span class=\"c5\">Archival Storage available for Lab with the Enterprise account only. Invoicing in increments of 500GB with each increment being $7. If Lab has more than 0GB in Archive it must pay for the 500GB of the Archive storage.</span></li></ul>"
                    }, {
                        "title": "To Set Up an Enterprise Plan",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To establish an Enterprise Account for your Lab you need to use drop down menu in the top-right:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_mwfwdpro1sgw-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Click on your name and select “Billing”; </span></li><li class=\"c0\"><span class=\"c5\">This will bring you to the page with the list of your Labs; </span></li></ol><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 161.33px;\"><img alt=\"\" src=\"user-guide-images/image2.png\" style=\"width: 624.00px; height: 161.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_mwfwdpro1sgw-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">Select the Lab where you want to establish an Enterprise Account; </span></li><li class=\"c0\"><span>Click on the Subscription stat</span><span>us</span><span class=\"c5\">; </span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 261.33px;\"><img alt=\"\" src=\"user-guide-images/image200.png\" style=\"width: 624.00px; height: 261.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><ol class=\"c10 lst-kix_mwfwdpro1sgw-0\" start=\"5\"><li class=\"c0\"><span class=\"c5\">Select “Enterprise” plan and hit “Next”; </span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 462.50px; height: 373.56px;\"><img alt=\"\" src=\"user-guide-images/image18.png\" style=\"width: 462.50px; height: 373.56px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><ol class=\"c10 lst-kix_mwfwdpro1sgw-0\" start=\"6\"><li class=\"c0\"><span class=\"c5\">Verify plan details and confirm by clicking “Save” button.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 446.50px; height: 380.29px;\"><img alt=\"\" src=\"user-guide-images/image26.png\" style=\"width: 446.50px; height: 380.29px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "To Enable Processing Feature",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">This feature is available for users of Free or Enterprise Storage Accounts. To enable Processing Feature use drop down menu in the top-right:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_fkfi5phosg7z-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Click on your name and select “Billing”;</span></li><li class=\"c0\"><span class=\"c5\">This will bring you to the page with the list of your Labs;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 161.33px;\"><img alt=\"\" src=\"user-guide-images/image2.png\" style=\"width: 624.00px; height: 161.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_fkfi5phosg7z-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">Select the lab where you want to activate processing feature; </span></li><li class=\"c0\"><span class=\"c5\">Click on the processing status (it is OFF by default); </span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 612.50px; height: 306.25px;\"><img alt=\"\" src=\"user-guide-images/image43.png\" style=\"width: 612.50px; height: 306.25px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><ol class=\"c10 lst-kix_fkfi5phosg7z-0\" start=\"5\"><li class=\"c0\"><span class=\"c5\">It will open dialog window where you need to check the “Enable processing” checkbox. There is an \"Autoprolongate\" option, if it checked the Lab doesn’t need to turn processing on every month;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 491.50px; height: 336.19px;\"><img alt=\"\" src=\"user-guide-images/image76.png\" style=\"width: 491.50px; height: 336.19px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_fkfi5phosg7z-0\" start=\"6\"><li class=\"c0\"><span class=\"c5\">Click “Next”;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 459.50px; height: 400.08px;\"><img alt=\"\" src=\"user-guide-images/image177.png\" style=\"width: 459.50px; height: 400.08px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_fkfi5phosg7z-0\" start=\"7\"><li class=\"c0\"><span class=\"c5\">Verify the details and hit “Save”. </span></li></ol>"
                    }, {
                        "title": "To Monitor the Cost of Your Account",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Each Laboratory Head can view real-time billing updates using the accounting tools in Chorus. The cost of services is broken down by day, type of services, and the user that processed the data.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Lab Account List </span></p><p class=\"c1 c15 c4\"><span class=\"c8\"></span></p><ol class=\"c10 lst-kix_swh6hs7x14hw-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Click on your name on the top right and select “Billing”. It will open Billing Labs List;</span></li><li class=\"c0\"><span class=\"c5\">Double click on Lab will open detailed information on features the lab uses.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 189.33px;\"><img alt=\"\" src=\"user-guide-images/image126.png\" style=\"width: 624.00px; height: 189.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">History List</span></p><p class=\"c1 c4\"><span class=\"c8\"></span></p><ol class=\"c10 lst-kix_vj2jt1vsqnl8-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Click on your name on the top right and select “Billing”. It will open Billing Labs List;</span></li><li class=\"c0\"><span class=\"c5\">Click on the Lab title and it will open account history list. </span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 593.50px; height: 299.00px;\"><img alt=\"\" src=\"user-guide-images/image78.png\" style=\"width: 593.50px; height: 299.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Daily History Details</span></p><p class=\"c1 c15 c4\"><span class=\"c8\"></span></p><ol class=\"c10 lst-kix_54zibrfpn1fl-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Click on your name on the top right and select “Billing”. It will open Billing Labs List;</span></li><li class=\"c0\"><span class=\"c5\">Click on the Lab name and it will open history list; </span></li><li class=\"c0\"><span>Click on the day you want to view the history details. &nbsp;</span></li></ol><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 575.50px; height: 360.61px;\"><img alt=\"\" src=\"user-guide-images/image46.png\" style=\"width: 575.50px; height: 360.61px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To View Storage Usage Details",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Go to the Lab Billing History page and click on </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 98.98px; height: 21.10px;\"><img alt=\"\" src=\"user-guide-images/image132.png\" style=\"width: 98.98px; height: 21.10px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">heading. It will open a dialog with the detailed information on storage usage. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 401.50px; height: 300.73px;\"><img alt=\"\" src=\"user-guide-images/image120.png\" style=\"width: 401.50px; height: 300.73px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "To Top Up Your Chorus Balance",
                        "content": "<p class=\"c1 c15\"><span>Go to the Lab Billing History page and click on the amount</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 107.10px; height: 22.50px;\"><img alt=\"\" src=\"user-guide-images/image166.png\" style=\"width: 107.10px; height: 22.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;heading. It will take you to the PayPal checkout page. </span></p><p class=\"c1 c15\"><span>To set up a PayPal account or to learn more about this payment option visit the </span><span class=\"c45\"><a class=\"c6\" href=\"https://www.google.com/url?q=https://www.paypal.com/&amp;sa=D&amp;ust=1531832129876000\">PayPal</a></span><span class=\"c5\">&nbsp;site.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 420.00px; height: 417.45px;\"><img alt=\"\" src=\"user-guide-images/image110.png\" style=\"width: 420.00px; height: 417.45px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "To Cancel Your Chorus Account",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>You can cancel your Chorus account at any time without charge or restrictions. The process is simple, simply contact </span><span class=\"c45\"><a class=\"c6\" href=\"mailto:support@choruproject.org\">support@choruproject.org</a></span><span class=\"c5\">&nbsp;and indicate that you would like to cancel your account. If you need time to restore data from Chorus will be glad to provide time to do that at no cost to you.</span></p>"
                    }, {
                        "title": "Instruments",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Chorus gives excellent results from instruments manufactured by:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_k76kfqtioi-0 start\"><li class=\"c0\"><span class=\"c5\">Agilent;</span></li><li class=\"c0\"><span class=\"c5\">Affymetrix;</span></li><li class=\"c0\"><span class=\"c5\">Brucker;</span></li><li class=\"c0\"><span>Illumina</span><span class=\"c5\">;</span></li><li class=\"c0\"><span class=\"c5\">PacBio;</span></li><li class=\"c0\"><span class=\"c5\">Roche;</span></li><li class=\"c0\"><span class=\"c5\">SOLID; </span></li><li class=\"c0\"><span class=\"c5\">Scinex;</span></li><li class=\"c0\"><span class=\"c5\">Thermo;</span></li><li class=\"c0\"><span class=\"c5\">Waters;</span></li><li class=\"c0\"><span>Wyatt.</span></li></ul>"
                    }, {
                        "title": "Send Request For Instrument Access",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">If you are a Lab User, you can send a request for access to the existing instrument in the Lab:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_hwswf529de7p-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Select \"Instruments\" item of the relevant Laboratory in the sidebar menu;</span></li><li class=\"c0\"><span class=\"c5\">It will open the list of all available instruments in the selected Lab;</span></li><li class=\"c0\"><span class=\"c5\">Select the instrument and click “Request” button;</span></li><li class=\"c0\"><span class=\"c5\">Access column will display the status of your request.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 177.33px;\"><img alt=\"\" src=\"user-guide-images/image23.png\" style=\"width: 624.00px; height: 177.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 173.33px;\"><img alt=\"\" src=\"user-guide-images/image137.png\" style=\"width: 624.00px; height: 173.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Your request will be sent to Instrument Creator for approval. Once it approved you automatically become an Instrument operator (for more details on Instrument operator role, see </span><span class=\"c45\"><a class=\"c6\" href=\"#h.nruf23l8fjnv\">Users and Roles</a></span><span class=\"c5\">&nbsp;section). </span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Send Request For Instrument Creation",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">If you are a Lab User, you can send a request for instrument creation to your Lab Head for approval:</span></p><p class=\"c1\"><span class=\"c5\">&nbsp;</span></p><ol class=\"c10 lst-kix_a0jppxmz7hjo-0 start\" start=\"1\"><li class=\"c0\"><span>Click &nbsp;</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 96.43px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image42.png\" style=\"width: 96.43px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span>&nbsp;button on the </span><span>top-left of the main page.</span><span class=\"c5\">&nbsp;Select “Instrument” from dropdown;</span></li><li class=\"c0\"><span class=\"c5\">Fill in all mandatory fields in “General” tab of “Create Instrument” dialog:</span></li></ol><ol class=\"c10 lst-kix_a0jppxmz7hjo-1 start\" start=\"1\"><li class=\"c1 c22\"><span class=\"c5\">Enter Instrument name;</span></li><li class=\"c1 c22\"><span class=\"c5\">Select Technology type;</span></li><li class=\"c1 c22\"><span class=\"c5\">Select Instrument vendor;</span></li><li class=\"c1 c22\"><span class=\"c5\">Select Instrument model;</span></li><li class=\"c1 c22\"><span class=\"c5\">Choose Laboratory in which you are going to use the instrument;</span></li><li class=\"c1 c22\"><span class=\"c5\">Enter serial number;</span></li></ol><p class=\"c1 c3\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 522.83px; height: 493.50px;\"><img alt=\"Screen Shot 2016-12-21 at 3.14.42 PM.png\" src=\"user-guide-images/image114.png\" style=\"width: 523.36px; height: 493.50px; margin-left: -0.27px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c27 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_a0jppxmz7hjo-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">Fill in optional fields if applicable;</span></li><li class=\"c0\"><span>Go to “Operators” tab if you want to add an operator (see </span><span class=\"c45\"><a class=\"c6\" href=\"#h.m7ih1z5zriq6\">Instrument Operators</a></span><span class=\"c5\">&nbsp;section);</span></li><li class=\"c0\"><span class=\"c5\">Click “Send Request” button.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Once your request is approved, you and Lab Head automatically become Instrument Operators. &nbsp;Instrument will be displayed in the sidebar in the list of available instruments for the appropriate Lab. <br></span></p>"
                    }, {
                        "title": "Create An Instrument",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Lab Head is able to create an Instrument all by himself:<br></span></p><ol class=\"c10 lst-kix_7etzi3kkm9k3-0 start\" start=\"1\"><li class=\"c0\"><span>Click &nbsp;</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 96.43px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image42.png\" style=\"width: 96.43px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button on the top-left of the main page. In the drop-down menu select “Instrument”;</span></li><li class=\"c0\"><span class=\"c5\">It will open a “Create Instrument” dialog. Fill in all mandatory fields in “General” tab: </span></li></ol><ol class=\"c10 lst-kix_7etzi3kkm9k3-1 start\" start=\"1\"><li class=\"c1 c22\"><span class=\"c5\">Enter Instrument name;</span></li><li class=\"c1 c22\"><span class=\"c5\">Select Technology type;</span></li><li class=\"c1 c22\"><span class=\"c5\">Select Instrument vendor;</span></li><li class=\"c1 c22\"><span class=\"c5\">Select Instrument model;</span></li><li class=\"c1 c22\"><span class=\"c5\">Choose Laboratory in which you are going to use the instrument;</span></li><li class=\"c1 c22\"><span class=\"c5\">Enter serial number;</span></li></ol><p class=\"c1 c3\"><span class=\"c5\"></span></p><p class=\"c1 c23\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 544.50px; height: 515.98px;\"><img alt=\"\" src=\"user-guide-images/image73.png\" style=\"width: 544.50px; height: 515.98px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_7etzi3kkm9k3-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">Fill in optional fields if applicable;</span></li><li class=\"c0\"><span>Go to “Operators” tab if you want to add an operator (see </span><span class=\"c45\"><a class=\"c6\" href=\"#h.m7ih1z5zriq6\">Instrument Operators</a></span><span class=\"c5\">&nbsp;section);</span></li><li class=\"c0\"><span class=\"c5\">Click “Create” button.</span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Instrument will appear in a sidebar in the list of available instruments for the appropriate Lab. </span></p>"
                    }, {
                        "title": "Instrument Operators",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To add a new Instrument operator:</span></p><ol class=\"c10 lst-kix_3q7665pdtj2m-0 start\" start=\"1\"><li class=\"c0\"><span>Go to the sidebar and open the Instrument for editing by using </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span>button</span><span class=\"c5\">;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 145.33px;\"><img alt=\"\" src=\"user-guide-images/image187.png\" style=\"width: 630.00px; height: 145.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_3q7665pdtj2m-0\" start=\"2\"><li class=\"c0\"><span class=\"c5\">Select “Operators” tab;</span></li><li class=\"c0\"><span class=\"c5\">Enter person’s email you want to add;</span></li><li class=\"c0\"><span class=\"c5\">Save the changes.<br></span></li></ol><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 430.50px; height: 320.66px;\"><img alt=\"Screen Shot 2016-12-08 at 7.28.47 PM.png\" src=\"user-guide-images/image184.png\" style=\"width: 430.50px; height: 325.61px; margin-left: 0.00px; margin-top: -2.47px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>The new Instrument will appear in the list of available Instruments of the recently added user.<br><br></span><span class=\"c9\">Please Note:</span><span class=\"c5\">&nbsp;User you want to add should be a member of the Lab for which this instrument is available.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><h3 class=\"c24 c25\" id=\"h.g6lhgmwcfqlk\"><span class=\"c13 c9\"></span></h3><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }]
                },
                {
                    key: "raw-data",
                    title: "Raw Data Upload and Management",
                    subtopics: [{
                        "title": "Raw Files Upload",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Chorus accepts files or folders with “.raw”; “.d”; “.wiff”; “.wiff.scan”; “.wiff.mtd”; “.dat”; “.mis” extensions. These files come straight from the spectrometers and contain intensity and retention time data for each detected peak. Uploading files on Chorus is available only if you are a user with instrument operator role (for more details see </span><span class=\"c45\"><a class=\"c6\" href=\"#h.nruf23l8fjnv\">Users and Roles</a></span><span class=\"c5\">&nbsp;section). </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">There are 5 ways to upload your data to the Chorus application:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_ckvs0htq6stn-0 start\"><li class=\"c0\"><span class=\"c5\">directly in the Chorus application via Upload Wizard;</span></li><li class=\"c0\"><span class=\"c5\">import files from FTP;</span></li><li class=\"c0\"><span class=\"c5\">import files from S3 bucket; </span></li><li class=\"c0\"><span class=\"c5\">via Desktop Uploader;</span></li><li class=\"c0\"><span class=\"c5\">via Autoimporter.</span></li></ul><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Each of the methods has its own benefits and serve for various purposes. Choose the appropriate method or combine them as you wish.<br></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 282.93px;\"><img alt=\"\" src=\"user-guide-images/image140.png\" style=\"width: 624.00px; height: 282.93px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Upload wizard",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">This method is a great choice if you need to upload files up to 4GB. </span></p><p class=\"c1 c15\"><span>Click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 106.16px; height: 25.02px;\"><img alt=\"\" src=\"user-guide-images/image90.png\" style=\"width: 106.16px; height: 25.02px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button on the top-right and select “Direct Upload” &nbsp;from the drop down. It will open an Upload Wizard that will assist you to upload your files step by step.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 134.67px;\"><img alt=\"\" src=\"user-guide-images/image197.png\" style=\"width: 630.00px; height: 134.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Step 1: Select Instrument</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_tj1o4t5xqp2r-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">In the field “Select Instrument” indicate the instrument you acquired data with; </span></li><li class=\"c0\"><span class=\"c5\">Choose the default model organism that the majority of your files are pertain to. If you unsure what to select then you can leave this field Unspecified; </span></li><li class=\"c0\"><span class=\"c5\">Click “Next” button to proceed. </span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 522.26px; height: 317.53px;\"><img alt=\"\" src=\"user-guide-images/image141.png\" style=\"width: 522.26px; height: 317.53px; margin-left: -0.00px; margin-top: -0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c27 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Step 2: Select Files</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_617k5852k7p0-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Browse through folders to look at desired data files or drag-and-drop them into the relevant window.</span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Upload as many files as you like, but total size of the files should not exceed 4GB.</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 479.50px; height: 394.07px;\"><img alt=\"\" src=\"user-guide-images/image65.png\" style=\"width: 479.50px; height: 394.07px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Step 3: Set Optional Labels</span><span class=\"c5\"><br></span></p><ol class=\"c10 lst-kix_u8saglda36vc-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">To change the species for individual file use drop down list in “Species” column;</span></li><li class=\"c0\"><span class=\"c5\">Set the label in the “Labels” column.</span></li><li class=\"c0\"><span class=\"c5\">Click “Upload” button and the process will begin.</span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Please Note:</span><span class=\"c5\">&nbsp;Setting labels allows you to ease the search and filtering your files in future. Also it allows other users to find your files. Make sure that you separate them with commas. &nbsp;</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 450.56px; height: 435.30px;\"><img alt=\"\" src=\"user-guide-images/image28.png\" style=\"width: 450.56px; height: 435.30px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Step 4: Uploading process</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Chorus uses a special chunking algorithm, so if your Internet connection is interrupted while uploading, your upload will resume where it left off when the connection is restored.</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 424.50px; height: 257.33px;\"><img alt=\"Screen Shot 2017-01-03 at 4.59.25 PM.png\" src=\"user-guide-images/image129.png\" style=\"width: 428.88px; height: 257.33px; margin-left: -2.19px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "Import Files From FTP",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>You can import files directly from FTP server instead of uploading them from your local storage. All you have to do is click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 109.78px; height: 25.83px;\"><img alt=\"\" src=\"user-guide-images/image90.png\" style=\"width: 109.78px; height: 25.83px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button on the top left and select “Upload from FTP server” option. It will open Import Files From FTP dialog. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c44\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 189.33px;\"><img alt=\"\" src=\"user-guide-images/image85.png\" style=\"width: 630.00px; height: 189.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_otup2nbiee3c-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Enter all required data and your FTP credentials;</span></li><li class=\"c0\"><span class=\"c5\">Hit “Start Upload” button and the process will begin. </span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 554.50px; height: 427.43px;\"><img alt=\"\" src=\"user-guide-images/image40.png\" style=\"width: 554.50px; height: 427.43px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Please Note:</span><span class=\"c5\">&nbsp;do not close the dialog until upload is finished.</span></p><h3 class=\"c24\" id=\"h.if5r22eoutyj\"><span class=\"c13 c9\">Import Files From S3 bucket</span></h3><ol class=\"c10 lst-kix_v7kd8x4hxji1-0 start\" start=\"1\"><li class=\"c1 c23 c36\"><span class=\"c8\">Copy from S3 bucket</span></li></ol><p class=\"c1 c15\"><span>You can import files directly from S3 bucket instead of uploading them from your local storage. All you have to do is click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 109.78px; height: 25.83px;\"><img alt=\"\" src=\"user-guide-images/image90.png\" style=\"width: 109.78px; height: 25.83px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button on the top left and select “From S3 bucket” option. It will open Import Files From S3 dialog. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 173.33px;\"><img alt=\"\" src=\"user-guide-images/image98.png\" style=\"width: 630.00px; height: 173.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 466.67px;\"><img alt=\"\" src=\"user-guide-images/image153.png\" style=\"width: 630.00px; height: 466.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1\"><span class=\"c5\">Enter all required data and click “Next” </span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 516.00px;\"><img alt=\"\" src=\"user-guide-images/image165.jpg\" style=\"width: 630.00px; height: 516.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1\"><span class=\"c5\">Enter File Mask (extension of your files) if necessary</span></p><p class=\"c1\"><span class=\"c5\">Enter bucket URL, AWS credentials and click “Next”</span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 494.67px;\"><img alt=\"\" src=\"user-guide-images/image138.png\" style=\"width: 630.00px; height: 494.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1\"><span class=\"c5\">select necessary files and upload them.</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span class=\"c9 c56\">2. Make references to S3 files</span></p><p class=\"c1 c4\"><span class=\"c56 c9\"></span></p><p class=\"c1\"><span class=\"c56 c60\">You can use “Make references” for using data from you own bucket without copying them into our system. You simply give access to your bucket.</span></p><p class=\"c1\"><span class=\"c56 c60\">Amazon S3 - Make references (if it isn't working, user needs to copy S3 policy by clicking on \"Get policy JSON\" then \"Copy to clipboard\" and put it in S3 console in buckets policy and click save) </span></p><p class=\"c1\"><span class=\"c5\">select necessary files and upload them.</span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 510.67px;\"><img alt=\"\" src=\"user-guide-images/image71.png\" style=\"width: 630.00px; height: 510.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "Desktop Uploader",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">The Desktop Uploader is a standalone Chorus application that lets you upload files directly from your PC. This is a perfect solution for uploading large files, as you can continue working while the upload is processing in the background. </span></p><p class=\"c1 c15\"><span class=\"c5\"><br> You can drag and drop single files, multiple files and whole folders. </span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Download Desktop Uploader",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_us5b61v9v03v-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Click the “Desktop Uploader” link in the Chorus page footer;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 104.00px;\"><img alt=\"\" src=\"user-guide-images/image56.png\" style=\"width: 630.00px; height: 104.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c27 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_us5b61v9v03v-0\" start=\"2\"><li class=\"c0\"><span class=\"c5\">The application will be downloaded as a zip file; </span></li><li class=\"c0\"><span class=\"c5\">Extract and copy this file to a destination directory of your choice;</span></li><li class=\"c0\"><span class=\"c5\">To start the Desktop Uploader simply double click the icon of “.exe” file.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Upload Your Files via Desktop Uploader",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_mgyzwb9fashw-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">After launching the application, you will be prompted to sign in into the cloud server with your Chorus credentials. Enter your email and password and then click “Sign in” button;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 354.47px;\"><img alt=\"\" src=\"user-guide-images/image87.png\" style=\"width: 624.00px; height: 354.47px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_mgyzwb9fashw-0\" start=\"2\"><li class=\"c0\"><span class=\"c5\">In the field “Select Instrument” choose the instrument that was used to acquire your data; </span></li><li class=\"c0\"><span class=\"c5\">Choose the default model organism that the majority of your files are pertain to. If you unsure what to select then you can leave this field unspecified; </span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 530.50px; height: 398.86px;\"><img alt=\"\" src=\"user-guide-images/image185.png\" style=\"width: 530.50px; height: 398.86px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_mgyzwb9fashw-0\" start=\"4\"><li class=\"c0\"><span class=\"c5\">Click “Next” button;</span></li><li class=\"c0\"><span class=\"c5\">Browse your computer for files and folders you want to upload or you can simply drag and drop files and whole folders straight from your desktop;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 496.00px; height: 371.30px;\"><img alt=\"\" src=\"user-guide-images/image79.png\" style=\"width: 496.00px; height: 371.30px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_mgyzwb9fashw-0\" start=\"6\"><li class=\"c0\"><span class=\"c5\">On the next page you may mark each of files with the optional labels to ease the search and filtering in future;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 482.50px; height: 363.48px;\"><img alt=\"\" src=\"user-guide-images/image134.png\" style=\"width: 482.50px; height: 363.48px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><ol class=\"c10 lst-kix_mgyzwb9fashw-0\" start=\"7\"><li class=\"c0\"><span class=\"c5\">Click on the Upload button. </span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">You will then see the upload progress of each file.</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 509.50px; height: 384.67px;\"><img alt=\"\" src=\"user-guide-images/image160.png\" style=\"width: 509.50px; height: 384.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "Auto-Importer",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">The Auto-importer tool by Chorus is designed to work in conjunction with your Instruments to automatically discover and import raw data files into the Chorus Application.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Download Auto-Importer",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_gfymjawtv783-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Click the “Autoimporter” link in the Chorus page footer.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 104.00px;\"><img alt=\"\" src=\"user-guide-images/image169.png\" style=\"width: 630.00px; height: 104.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_gfymjawtv783-0\" start=\"2\"><li class=\"c0\"><span class=\"c5\">The application will be downloaded as a zip file; </span></li><li class=\"c0\"><span class=\"c5\">Unpack it to a destination directory of your choice;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Plese Note:</span><span>&nbsp;If you are using Thermo instruments, please install the latest MS Raw File Reader drivers from </span><span class=\"c45\"><a class=\"c6\" href=\"https://www.google.com/url?q=http://sjsupport.thermofinnigan.com/public/detail.asp?id%3D703&amp;sa=D&amp;ust=1531832129909000\">http://sjsupport.thermofinnigan.com/public/detail.asp?id=703</a></span><span class=\"c5\">&nbsp;to enable file validation and live support for ongoing data processing from the instrument. Otherwise processing of ongoing experiment data will work incorrectly.</span></p><p class=\"c1 c15\"><span>Open source works best when you give feedback: </span><span class=\"c45\"><a class=\"c6\" href=\"https://www.google.com/url?q=https://chorusproject.org&amp;sa=D&amp;ust=1531832129909000\">https://chorusproject.org</a></span><span class=\"c5\">&nbsp;</span></p><p class=\"c1 c15\"><span>Please direct all bug reports to chorus-project forum: </span><span class=\"c45\"><a class=\"c6\" href=\"https://www.google.com/url?q=https://groups.google.com/forum/%23!forum/chorus-project&amp;sa=D&amp;ust=1531832129910000\">https://groups.google.com/forum/#!forum/chorus-project</a></span></p><p class=\"c1 c15\"><span>Also see FAQ in chorus-project support: </span><span class=\"c45\"><a class=\"c6\" href=\"https://www.google.com/url?q=https://chorusproject.org/pages/support.html&amp;sa=D&amp;ust=1531832129910000\">https://chorusproject.org/pages/support.html</a></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Install Auto-Importer",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_isho76j8cjdd-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Install JDK 1.8.x (see www.oracle.com for more details);</span></li><li class=\"c0\"><span class=\"c5\">Make sure the folder with the app does not contain any space characters;</span></li><li class=\"c0\"><span class=\"c5\">Start \"\\service\\start.bat\" file as Administrator;</span></li><li class=\"c0\"><span class=\"c5\">Wait until the console is closed then restart your PC;</span></li><li class=\"c0\"><span class=\"c5\">Run \"\\ui\\Chorus Uploader.exe\". &nbsp;</span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Spectrum and Chromatogram Viewers",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Types of Chromatogram</span><span class=\"c5\">&nbsp;</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_chvrme5g0iev-0 start\"><li class=\"c0\"><span>Total Ion Current (TIC).</span><span class=\"c5\">&nbsp;<br>A TIC chromatogram can be thought of as a summed spectrum plotted over time. It shows the total current resulting from the detection of ions (of whatever mass) over the period of the MS scan.</span></li></ul><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_iqbw40dcdi3r-0 start\"><li class=\"c1 c36 c23\"><span class=\"c5\">Base Peak Intensity (BPI). <br>The default type of chromatogram opened in Chorus, a BPI chromatogram is a variant of a TIC chromatogram. It plots, for each scan throughout the period of MS scan, the intensity of only the most abundant ion at the tie of that scan. It ignores all the other, less abundant, ions detected at the same time.<br>The BPI exhibits a greater apparent resolution and signal-to-noise but will only contain contributions from the most intense components. &nbsp;Therefore, it is possible that some peaks in the TIC chromatogram may not be visible in the BPI chromatogram. </span></li></ul><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Spectrum</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">The spectrum chart shows the mass-to-charge ratio of ions detected during data acquisition. You can use the Charts viewer to step through the data obtained during the scans, or see the results of a number of scans on screen at one time.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Open Charts Viewer",
                        "content": "<p class=\"c1 c15\"><span>Click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 24.00px; height: 23.00px;\"><img alt=\"\" src=\"user-guide-images/image133.png\" style=\"width: 24.00px; height: 23.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;sign of the file you want to view; </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c27 c44\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 608.34px; height: 252.50px;\"><img alt=\"\" src=\"user-guide-images/image170.png\" style=\"width: 608.34px; height: 252.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>In order to view charts of several files for comparison, select the checkboxes of the relevant files and click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 47.69px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image88.png\" style=\"width: 47.69px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;control panel button.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c27 c44\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 174.67px;\"><img alt=\"\" src=\"user-guide-images/image32.png\" style=\"width: 624.00px; height: 174.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">You will now see the chromatogram (upper pane) and spectrum (lower pane) of the data acquired from running the selected file(s). </span></p><p class=\"c1 c15 c4\"><span class=\"c8\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Chromatogram.</span><span class=\"c5\">&nbsp;Time is shown along the x axis (horizontal) and intensity is shown along y axis (vertical).</span></p><p class=\"c1 c15\"><span class=\"c9\">Spectrum.</span><span class=\"c5\">&nbsp;The mass-to-charge ratio is shown along the x axis (horizontal) and intensity is shown along the y axis (vertical).</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"><br></span></p><p class=\"c1 c15\"><span class=\"c8\">There are several important areas on the screen to note:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_o42uf0zeg8la-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Function (type of scan);</span></li><li class=\"c0\"><span class=\"c5\">Data file name;</span></li><li class=\"c0\"><span class=\"c5\">Chromatogram description: type of chromatogram, m/z range, number of ions detected at the largest peak;</span></li><li class=\"c0\"><span class=\"c5\">Spectrum description: type of spectrum, rt range, number of ions detected at the largest peak;</span></li><li class=\"c0\"><span class=\"c5\">Tools for adjusting the ranges for specific sections of a chromatogram and spectrum.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c37\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 705.33px; height: 371.50px;\"><img alt=\"\" src=\"user-guide-images/image83.png\" style=\"width: 705.33px; height: 371.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Charts Viewer Tools",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><a id=\"t.f0104bebf10865ccf2479b4cf63473a71c9b05c5\"></a><a id=\"t.1\"></a><table class=\"c65\"><tbody><tr class=\"c58\"><td class=\"c16\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 97.02px; height: 24.50px;\"><img alt=\"\" src=\"user-guide-images/image124.png\" style=\"width: 97.02px; height: 24.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4 c28\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p></td><td class=\"c7\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span class=\"c5\">Zoom/</span></p><p class=\"c1 c28\"><span class=\"c5\">Range</span></p></td><td class=\"c30\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c41\"><span class=\"c5\">Zoom. Press to zoom the current chart for the selected range. &nbsp; &nbsp; </span></p><p class=\"c1 c41\"><span class=\"c5\">Range. Press to select the range to display it on the other chart.</span></p><p class=\"c41 c4 c68\"><span class=\"c5\"></span></p></td></tr><tr class=\"c47\"><td class=\"c16\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 51.50px; height: 24.52px;\"><img alt=\"\" src=\"user-guide-images/image72.png\" style=\"width: 51.50px; height: 24.52px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p></td><td class=\"c7\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span class=\"c5\">Export</span></p></td><td class=\"c30\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c41\"><span class=\"c5\">Press to export .svg image.</span></p></td></tr><tr class=\"c47\"><td class=\"c16\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 74.50px; height: 26.61px;\"><img alt=\"\" src=\"user-guide-images/image13.png\" style=\"width: 74.50px; height: 26.61px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p></td><td class=\"c7\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span class=\"c5\">TIC/</span></p><p class=\"c1 c28\"><span class=\"c5\">BPI</span></p></td><td class=\"c30\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c41\"><span class=\"c5\">Configures the display to view the Total Ion Chromatogram (TIC) or Base Peak Intensity (BPI).</span></p></td></tr><tr class=\"c47\"><td class=\"c16\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 26.95px; height: 24.50px;\"><img alt=\"\" src=\"user-guide-images/image9.png\" style=\"width: 26.95px; height: 24.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p></td><td class=\"c7\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span class=\"c5\">Reset all</span></p></td><td class=\"c30\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c41\"><span class=\"c5\">Press to reset all manipulations.</span></p></td></tr><tr class=\"c47\"><td class=\"c16\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 29.50px; height: 27.76px;\"><img alt=\"\" src=\"user-guide-images/image115.png\" style=\"width: 29.50px; height: 27.76px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p></td><td class=\"c7\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span class=\"c5\">Reset zoom</span></p></td><td class=\"c30\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c41\"><span class=\"c5\">Press to restore the data display to the full range of the x axis and y axis.</span></p></td></tr><tr class=\"c47\"><td class=\"c16\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 27.73px; height: 30.50px;\"><img alt=\"\" src=\"user-guide-images/image25.png\" style=\"width: 27.73px; height: 30.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p></td><td class=\"c7\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span class=\"c5\">Step left</span></p></td><td class=\"c30\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c41\"><span class=\"c5\">Press to make step left along x axis.</span></p></td></tr><tr class=\"c47\"><td class=\"c16\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 29.37px; height: 30.50px;\"><img alt=\"\" src=\"user-guide-images/image191.png\" style=\"width: 29.37px; height: 30.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p></td><td class=\"c7\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span class=\"c5\">Step right</span></p></td><td class=\"c30\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c41\"><span class=\"c5\">Press to make step right along x axis.</span></p></td></tr><tr class=\"c47\"><td class=\"c16\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 28.50px; height: 30.69px;\"><img alt=\"\" src=\"user-guide-images/image183.png\" style=\"width: 28.50px; height: 30.69px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p></td><td class=\"c7\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span class=\"c5\">Zoom in</span></p></td><td class=\"c30\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c41\"><span class=\"c5\">Press to zoom in to the currently displayed chart.</span></p></td></tr><tr class=\"c47\"><td class=\"c16\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 29.60px; height: 28.50px;\"><img alt=\"\" src=\"user-guide-images/image27.png\" style=\"width: 29.60px; height: 28.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p></td><td class=\"c7\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c28\"><span class=\"c5\">Zoom out</span></p></td><td class=\"c30\" colspan=\"1\" rowspan=\"1\"><p class=\"c1 c41\"><span class=\"c5\">Press to zoom out the currently displayed chart.</span></p></td></tr></tbody></table><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c3\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Viewing and Manipulating Chromatogram and Spectra",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To enable you to focus on the most important areas of the results, the Chromatogram and Spectrum panes can be changed in number of ways.</span></p><p class=\"c1 c15\"><span>You can use menu commands to select display options or use the cursor to select regions of interest. &nbsp;Both charts are interactive. </span></p><p class=\"c1 c15 c4\"><span class=\"c8\"></span></p><p class=\"c1 c15\"><span class=\"c8\">To alter the range of x axis </span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_4s4vkk3aebp4-0 start\" start=\"1\"><li class=\"c0\"><span>Select “Zoom” </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 97.19px; height: 25.00px;\"><img alt=\"\" src=\"user-guide-images/image124.png\" style=\"width: 97.19px; height: 25.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;toolbar button;</span></li><li class=\"c0\"><span class=\"c5\">Press left mouse button at one end of the region of interest, and without releasing the button, drag the mouse horizontally to the other end;</span></li><li class=\"c0\"><span class=\"c5\">As you drag the mouse you will see a “rubber band” stretched out to indicate the range you have selected including rt or m/z values for this range;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 333.33px;\"><img alt=\"\" src=\"user-guide-images/image37.png\" style=\"width: 630.00px; height: 333.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c27 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_4s4vkk3aebp4-0\" start=\"4\"><li class=\"c0\"><span class=\"c5\">Release the mouse button and the selected range will be re-displayed to fill the current pane.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 330.67px;\"><img alt=\"\" src=\"user-guide-images/image173.png\" style=\"width: 630.00px; height: 330.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c8\"></span></p><p class=\"c27 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Pressing </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 29.50px; height: 27.76px;\"><img alt=\"\" src=\"user-guide-images/image115.png\" style=\"width: 29.50px; height: 27.76px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button restores the display to the default range. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">To Select a Point on Chart</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">The following procedure describes how to work interactively with chromatogram and spectrum view to display a point of interest in the desired view. For example, you can use this procedure to display the spectrum for a particular time point in a chromatogram. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_1p3ppjumsv17-0 start\"><li class=\"c0\"><span>To display spectrum for a single point on a chromatogram trace</span><span class=\"c5\">, click on the point of the chromatogram for which you want to see the spectrum. The spectrum view will display the relevant spectrum.</span></li></ul><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 413.33px;\"><img alt=\"\" src=\"user-guide-images/image194.png\" style=\"width: 630.00px; height: 413.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\"><br><br></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_yv8ufkgrv0jh-0 start\"><li class=\"c0\"><span class=\"c5\">To open chromatogram for a single mass shown on the spectrum, click on the point of the spectrum you want to see the chromatogram for. The chromatogram view will display the relevant chromatogram.</span></li></ul><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 412.00px;\"><img alt=\"\" src=\"user-guide-images/image182.png\" style=\"width: 630.00px; height: 412.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Pressing </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 26.95px; height: 24.50px;\"><img alt=\"\" src=\"user-guide-images/image9.png\" style=\"width: 26.95px; height: 24.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button restores the display to the default view. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">To display spectrum for a time range</span></p><p class=\"c1 c15 c4\"><span class=\"c8\"></span></p><ol class=\"c10 lst-kix_a599odq6c1i9-0 start\" start=\"1\"><li class=\"c0\"><span>Select “Range” </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 97.19px; height: 25.00px;\"><img alt=\"\" src=\"user-guide-images/image124.png\" style=\"width: 97.19px; height: 25.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;toolbar button;</span></li><li class=\"c0\"><span>D</span><span class=\"c5\">rag the cursor across a peak of interest in the chromatogram view;</span></li><li class=\"c0\"><span class=\"c5\">A red horizontal marker defines the selection range;</span></li><li class=\"c0\"><span>The spectrum view displays a </span><span class=\"c5\">spectrum that is the average of the scans during the selected time range.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27 c71\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 655.50px; height: 429.72px;\"><img alt=\"\" src=\"user-guide-images/image175.png\" style=\"width: 655.50px; height: 429.72px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">To display chromatogram for a range of masses</span><span class=\"c5\">&nbsp;</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_m66jlcp20bwe-0 start\" start=\"1\"><li class=\"c0\"><span>Select “Range” </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 97.19px; height: 25.00px;\"><img alt=\"\" src=\"user-guide-images/image124.png\" style=\"width: 97.19px; height: 25.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;toolbar button;</span></li><li class=\"c0\"><span class=\"c5\">Right-click on the smallest mass you wish to include;</span></li><li class=\"c0\"><span class=\"c5\">Drag to the largest mass you wish to include; a line will be drawn to show the extent of the masses that will be included. </span></li><li class=\"c0\"><span class=\"c5\">Release the mouse button; the Chromatogram view will display the chromatogram for the mass range.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 414.67px;\"><img alt=\"\" src=\"user-guide-images/image17.png\" style=\"width: 630.00px; height: 414.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Data Organization and Navigation",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Chorus data organization is as follows:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Projects ➝ Experiments ➝ Files<br><br>Here is a brief explanation of the Chorus data hierarchy:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Projects</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">This tab contains:</span></p><ul class=\"c10 lst-kix_lz850dvq6iso-0 start\"><li class=\"c0\"><span class=\"c5\">Your own projects; </span></li><li class=\"c0\"><span class=\"c5\">Projects that are shared with you; </span></li><li class=\"c0\"><span class=\"c5\">Public projects. </span></li></ul><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Each project contains experiments. Click on the project title to see the experiments in it.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 1.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 366.67px;\"><img alt=\"\" src=\"user-guide-images/image55.png\" style=\"width: 624.00px; height: 366.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Experiments</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">This tab contains:</span></p><ul class=\"c10 lst-kix_pwnrz2lq6c1l-0 start\"><li class=\"c0\"><span class=\"c5\">Your own experiments that are a part of a certain project;</span></li><li class=\"c0\"><span class=\"c5\">Experiments that are shared with you;</span></li><li class=\"c0\"><span class=\"c5\">Public experiments. </span></li></ul><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Experiments contain files. Click on the experiment title and it will open the list of files that are used in the current experiment.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 1.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 150.47px;\"><img alt=\"\" src=\"user-guide-images/image103.png\" style=\"width: 708.47px; height: 150.47px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Files</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">This tab contains:</span></p><ul class=\"c10 lst-kix_opq1az6xqgh4-0 start\"><li class=\"c0\"><span class=\"c5\">Your uploaded files;</span></li><li class=\"c0\"><span class=\"c5\">Files that are shared with you;</span></li><li class=\"c0\"><span class=\"c5\">Public files. &nbsp;</span></li></ul><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 1.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 189.40px;\"><img alt=\"\" src=\"user-guide-images/image36.png\" style=\"width: 624.00px; height: 264.13px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Search Bar",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To ease data searching you can use Search bar. It is located at the top middle of your screen:</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 170.67px;\"><img alt=\"\" src=\"user-guide-images/image172.png\" style=\"width: 624.00px; height: 170.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Advanced Search",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">The Advanced Search form lets you focus your search, giving you more control over the results. You can access the Advanced Search form by clicking “Advanced” link:</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 188.00px;\"><img alt=\"\" src=\"user-guide-images/image93.png\" style=\"width: 624.00px; height: 188.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_199fjwdvglfe-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Enter or select search terms in the fields;</span></li><li class=\"c0\"><span class=\"c5\">Use operators such as AND/OR to narrow or broaden your search;</span></li><li class=\"c0\"><span class=\"c5\">Click \"Apply\" button.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 309.33px;\"><img alt=\"\" src=\"user-guide-images/image128.png\" style=\"width: 624.00px; height: 309.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Edit Columns in Tables",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To edit columns:</span></p><ol class=\"c10 lst-kix_syx0bfl26dp1-0 start\" start=\"1\"><li class=\"c0\"><span>Click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 34.00px; height: 28.00px;\"><img alt=\"\" src=\"user-guide-images/image5.png\" style=\"width: 34.00px; height: 28.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button on the top right;</span></li><li class=\"c0\"><span class=\"c5\">Add and remove columns using checkboxes;</span></li><li class=\"c0\"><span class=\"c5\">Change the order of the columns by dragging a list item; </span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 374.67px;\"><img alt=\"\" src=\"user-guide-images/image81.png\" style=\"width: 624.00px; height: 374.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Deleting Data",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To Delete One File/Experiment:</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_rx7p4ottxs0f-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Select the checkbox of the relevant item;</span></li><li class=\"c0\"><span>Click on </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span>button or use </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 59.00px; height: 25.00px;\"><img alt=\"\" src=\"user-guide-images/image104.png\" style=\"width: 59.00px; height: 25.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button on a top-right ;</span></li><li class=\"c0\"><span class=\"c5\">Select “Delete” from the dropdown.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 197.33px;\"><img alt=\"\" src=\"user-guide-images/image178.png\" style=\"width: 624.00px; height: 197.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_rx7p4ottxs0f-0\" start=\"4\"><li class=\"c0\"><span class=\"c5\">The confirmation dialog box will appear to prevent accidental deletion of data;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 245.33px;\"><img alt=\"\" src=\"user-guide-images/image4.png\" style=\"width: 624.00px; height: 245.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_rx7p4ottxs0f-0\" start=\"5\"><li class=\"c0\"><span class=\"c5\">“Remove permanently” checkbox is marked by default. Unmark it if you unsure that you want to delete it permanently;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Delete Several Files",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_6qmtrqnkvqr1-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Select the checkbox of the relevant items;</span></li><li class=\"c0\"><span>Go to control panel on a top right and click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 59.00px; height: 25.00px;\"><img alt=\"\" src=\"user-guide-images/image104.png\" style=\"width: 59.00px; height: 25.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Trash",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">The Trash folder allows you to recover your data that have been deleted. You can access it by clicking the link in the Sidebar. You can sort items in the trash by their ID, name, type, laboratory and deletion date. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Please note:</span><span>&nbsp;</span><span class=\"c5\">The items in your Trash count toward the storage space.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Restoring Data From Trash",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To restore an item:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_f915ey1wk97y-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Select the check box to the left of one or more items you want to recover; </span></li><li class=\"c0\"><span class=\"c5\">Click the “Restore” button at the top right of the page;</span></li></ol><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><p class=\"c27 c52 c59\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 645.50px; height: 140.00px;\"><img alt=\"\" src=\"user-guide-images/image196.png\" style=\"width: 645.50px; height: 140.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_f915ey1wk97y-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">Confirm your decision. </span></li></ol><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 214.67px;\"><img alt=\"\" src=\"user-guide-images/image14.png\" style=\"width: 624.00px; height: 214.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Recovered files will be restored to the location from which they were deleted.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Raw Data Archival And Restore",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Data archival is available for Labs with </span><span class=\"c45\"><a class=\"c6\" href=\"#h.5y2bhk2kjeut\">Enterprise Account</a></span><span class=\"c5\">&nbsp;only. Files on which there has been no activity for 1000 days will automatically be archived. You can manually archive files and experiments if you wish. It allows to reduce the storage costs. You can only archive data on which you have edit rights. <br></span></p><p class=\"c1 c15\"><span class=\"c9\">Important:</span><span class=\"c5\">&nbsp;File download is not immediate in this case, since it takes several hours to get the data from archive. Also you won't be able to perform files translation while they are archived.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Please note:</span><span class=\"c5\">&nbsp;Projects cannot be archived - only files and experiments.</span></p><p class=\"c1 c15\"><span class=\"c9\">Note:</span><span class=\"c5\">&nbsp;No new Protein ID searches or charts can be run for archived files and experiments.</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Archive One or More of Your Files",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_36eonjwk37ft-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Select the checkbox of each file(s) you want to archive;</span></li><li class=\"c0\"><span class=\"c5\">Call context menu for the file and press \"Archive\". </span></li><li class=\"c0\"><span>In order to archive several items, select files and use control panel button</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 49.00px; height: 28.00px;\"><img alt=\"\" src=\"user-guide-images/image34.png\" style=\"width: 49.00px; height: 28.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;on a top right; </span></li></ol><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><p class=\"c27 c52 c69\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 637.50px; height: 207.27px;\"><img alt=\"\" src=\"user-guide-images/image54.png\" style=\"width: 637.50px; height: 207.27px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_36eonjwk37ft-0\" start=\"4\"><li class=\"c0\"><span class=\"c5\">Confirm archivation by clicking “Archive”.</span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 241.33px;\"><img alt=\"\" src=\"user-guide-images/image199.png\" style=\"width: 624.00px; height: 241.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">The archived file(s) will still remain in the list but it will be grayed out. However, you can perform the following actions with this file:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_pyk2xnwwxl3z-0 start\"><li class=\"c0\"><span class=\"c5\">Download;</span></li><li class=\"c0\"><span class=\"c5\">Unarchive;</span></li><li class=\"c0\"><span class=\"c5\">Edit;</span></li><li class=\"c0\"><span class=\"c5\">View charts if the file is already translated;</span></li><li class=\"c0\"><span class=\"c5\">Delete.</span></li></ul><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Unarchive One or More of Your Files",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_r6ohfpsza1ul-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Select the checkbox of the file(s) you want to unarchive;</span></li><li class=\"c0\"><span>Call context menu </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;for the file and select “Unarchive” from the drop down menu; </span></li><li class=\"c0\"><span>In case you want to unarchive several items, select them and use control panel button</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 48.00px; height: 25.00px;\"><img alt=\"\" src=\"user-guide-images/image44.png\" style=\"width: 48.00px; height: 25.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;on a top right; </span></li></ol><p class=\"c1 c31\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 238.67px;\"><img alt=\"\" src=\"user-guide-images/image189.png\" style=\"width: 624.00px; height: 238.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_r6ohfpsza1ul-0\" start=\"4\"><li class=\"c0\"><span class=\"c5\">Confirm unarchiving by clicking “Unarchive”.</span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c51\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 242.67px;\"><img alt=\"\" src=\"user-guide-images/image190.png\" style=\"width: 624.00px; height: 242.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>To the right of the file(s) title you’ll see </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 24.00px; height: 23.00px;\"><img alt=\"\" src=\"user-guide-images/image181.png\" style=\"width: 24.00px; height: 23.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;sign. It means that Unarchiving is in progress. Once the process is complete, file will look like as a regular one. </span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Raw files download",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">You can download:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_mbxfvh15ee07-0 start\"><li class=\"c0\"><span>Private files</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 20.00px; height: 21.00px;\"><img alt=\"\" src=\"user-guide-images/image47.png\" style=\"width: 20.00px; height: 21.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;;</span></li><li class=\"c0\"><span>Shared files </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 22.00px; height: 23.00px;\"><img alt=\"\" src=\"user-guide-images/image174.png\" style=\"width: 22.00px; height: 23.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">;</span></li><li class=\"c0\"><span>Public files </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 24.00px; height: 23.00px;\"><img alt=\"\" src=\"user-guide-images/image127.png\" style=\"width: 24.00px; height: 23.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">;</span></li><li class=\"c0\"><span>Private experiments </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 20.00px; height: 21.00px;\"><img alt=\"\" src=\"user-guide-images/image47.png\" style=\"width: 20.00px; height: 21.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">;</span></li><li class=\"c0\"><span>Shared experiments </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 22.00px; height: 23.00px;\"><img alt=\"\" src=\"user-guide-images/image29.png\" style=\"width: 22.00px; height: 23.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">;</span></li><li class=\"c0\"><span>Public experiments </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 24.00px; height: 23.00px;\"><img alt=\"\" src=\"user-guide-images/image127.png\" style=\"width: 24.00px; height: 23.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">;</span></li><li class=\"c0\"><span class=\"c5\">Share a download link of an experiment.</span></li></ul><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Download An Experiment:",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">There are two ways to download an experiment:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_m7zm20y8ge2s-0 start\" start=\"1\"><li class=\"c0\"><span>Click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">button of the experiment you want to download → Select “Download” from the drop down menu;</span></li></ol><p class=\"c1 c15\"><span class=\"c5\">OR</span></p><ol class=\"c10 lst-kix_m7zm20y8ge2s-0\" start=\"2\"><li class=\"c0\"><span>Use </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 14.00px; height: 19.00px;\"><img alt=\"\" src=\"user-guide-images/image38.png\" style=\"width: 14.00px; height: 19.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">sign on the right of the experiment name. </span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 310.67px;\"><img alt=\"\" src=\"user-guide-images/image67.png\" style=\"width: 624.00px; height: 310.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Experiment design together with sample annotations and all raw files will be downloaded as one zip file.</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Files Downloading",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">There are three ways to download file(s):</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_cyjbks1bnev8-0 start\" start=\"1\"><li class=\"c0\"><span>Click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">button of the file you want to download → Select “Download” from the drop down menu;</span></li></ol><p class=\"c1 c19\"><span class=\"c5\">OR</span></p><ol class=\"c10 lst-kix_cyjbks1bnev8-0\" start=\"2\"><li class=\"c0\"><span>Use </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 14.00px; height: 19.00px;\"><img alt=\"\" src=\"user-guide-images/image38.png\" style=\"width: 14.00px; height: 19.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">sign on the right of the file name;</span></li></ol><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><p class=\"c1 c19\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 192.00px;\"><img alt=\"\" src=\"user-guide-images/image176.png\" style=\"width: 624.00px; height: 192.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_cyjbks1bnev8-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">In case you want to download batch of files simultaneously:</span></li></ol><ol class=\"c10 lst-kix_cyjbks1bnev8-1 start\" start=\"1\"><li class=\"c1 c53 c36\"><span class=\"c5\">Select the check boxes to the left of files you want to download;</span></li><li class=\"c1 c53 c36\"><span>Click control panel button </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 56.00px; height: 28.00px;\"><img alt=\"\" src=\"user-guide-images/image121.png\" style=\"width: 56.00px; height: 28.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;on a top right.</span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 129.33px;\"><img alt=\"\" src=\"user-guide-images/image123.png\" style=\"width: 624.00px; height: 129.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Please note:</span><span class=\"c5\">&nbsp;When you download batch of files, they will be downloaded as one zip file.</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Share a Download Link of Public Experiment",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Please note:</span><span>&nbsp; You may share a download link of </span><span>public</span><span>&nbsp;experiments</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 24.00px; height: 23.00px;\"><img alt=\"\" src=\"user-guide-images/image127.png\" style=\"width: 24.00px; height: 23.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;with people who does not have a Chorus account. </span></p><ol class=\"c10 lst-kix_g5z7ivza5usr-0 start\" start=\"1\"><li class=\"c0\"><span>Click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">button of the experiment you want to share;</span></li><li class=\"c0\"><span class=\"c5\">Select “Share link” from the drop down menu;</span></li></ol><p class=\"c1 c31\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 238.67px;\"><img alt=\"\" src=\"user-guide-images/image130.png\" style=\"width: 624.00px; height: 238.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_g5z7ivza5usr-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">Copy the link or enter email of a person you want to share with;</span></li><li class=\"c0\"><span class=\"c5\">Click “Email link” button.</span></li></ol><p class=\"c14\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 420.50px; height: 265.20px;\"><img alt=\"\" src=\"user-guide-images/image107.png\" style=\"width: 420.50px; height: 265.20px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c4 c14\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Experiment design together with sample annotations and all raw files will be downloaded as one zip file.</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Share a Download Link of Shared Private Experiment",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Please note: </span><span>Download link for shared with you experiments that are private </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 20.00px; height: 21.00px;\"><img alt=\"\" src=\"user-guide-images/image47.png\" style=\"width: 20.00px; height: 21.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;can be accessed only by Chorus users this experiment has been shared to.</span></p><ol class=\"c10 lst-kix_s2tdrjdsa1qh-0 start\" start=\"1\"><li class=\"c0\"><span>Click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">button of the experiment you want to share;</span></li><li class=\"c0\"><span class=\"c5\">Select “Share link” from the drop down menu;</span></li></ol><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><p class=\"c27 c19\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 232.00px;\"><img alt=\"\" src=\"user-guide-images/image94.png\" style=\"width: 624.00px; height: 232.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_s2tdrjdsa1qh-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">Copy the link or enter email of a person you want to share with;</span></li><li class=\"c0\"><span class=\"c5\">Click “Email link” button.</span></li></ol>"
                    }]
                },
                {
                    key: "project-and-experiment",
                    title: "Project and Experiment Management",
                    subtopics: [{
                        "title": "Projects",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Projects allow you to group your experiments together. Further you can invite collaborators to your project so they can upload their experiments.</span></p>"
                    }, {
                        "title": "Project Creation",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_u8t09kvl1r1q-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Click “Create” button on the top left;</span></li><li class=\"c0\"><span class=\"c5\">Select “Project” from the drop down menu;</span></li></ol><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><p class=\"c1 c19 text-indent-zero\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 156.00px;\"><img alt=\"\" src=\"user-guide-images/image159.png\" style=\"width: 624.00px; height: 156.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4 c19\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_u8t09kvl1r1q-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">It will open a Create Project dialog window; </span></li></ol><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 412.50px; height: 479.17px;\"><img alt=\"\" src=\"user-guide-images/image136.png\" style=\"width: 412.50px; height: 479.17px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_u8t09kvl1r1q-0\" start=\"4\"><li class=\"c0\"><span class=\"c5\">In General tab enter the name of your Project;</span></li><li class=\"c0\"><span class=\"c5\">Select your Laboratory;</span></li><li class=\"c0\"><span class=\"c5\">Area of Research is totally up to you, but try to be as descriptive as possible;</span></li><li class=\"c0\"><span class=\"c5\">To enable blog check “Enable Blog” checkbox;</span></li><li class=\"c0\"><span class=\"c5\">Descriptions are optional and so Attachments;</span></li><li class=\"c0\"><span>If you want to share your Project go to the Sharing tab (see </span><span class=\"c45\"><a class=\"c6\" href=\"#h.ljxf6i5rdyq9\">Project Sharing </a></span><span>section</span><span class=\"c5\">);</span></li><li class=\"c0\"><span class=\"c5\">Click “Create” button.</span></li></ol><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Once you created your own Project it will appear on the Sidebar under All Projects.</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Edit Your Project",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_qy26d3ckmrvd-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Go to the Sidebar and select “My projects”;</span></li><li class=\"c0\"><span>Select the Project you want to edit &nbsp;and click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">button;</span></li><li class=\"c0\"><span class=\"c5\">Select “Edit” from the drop-down menu;<br></span></li></ol><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 190.67px;\"><img alt=\"\" src=\"user-guide-images/image193.png\" style=\"width: 624.00px; height: 190.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_qy26d3ckmrvd-0\" start=\"4\"><li class=\"c0\"><span class=\"c5\">It will open a dialog where you can change project name, change area of research, add attachments and description, view details of your project;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_qy26d3ckmrvd-0\" start=\"5\"><li class=\"c0\"><span class=\"c5\">Click “Save” button to save the changes.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Project Sharing",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Your Project is private by default . You can invite collaborators to your Project or you can make it public, so everyone on Chorus can view and download data in scope of your Project. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Sharing Projects is very simple:</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_fgr9sz5azz4f-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">&nbsp;Go to the Sidebar and select “My projects”;</span></li><li class=\"c0\"><span>Select the Project you want to share and click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">button;</span></li><li class=\"c0\"><span class=\"c5\">Select “Edit” from the drop-down menu;</span></li><li class=\"c0\"><span class=\"c5\">Select “Sharing” tab;</span></li><li class=\"c0\"><span>Invite people personally or by groups (See </span><span class=\"c45\"><a class=\"c6\" href=\"#h.xeu5bm7kehfp\">C</a></span><span class=\"c45\"><a class=\"c6\" href=\"#h.xeu5bm7kehfp\">reate a Sharing</a></span><span class=\"c45\"><a class=\"c6\" href=\"#h.xeu5bm7kehfp\">&nbsp;Group</a></span><span class=\"c5\">&nbsp;section). Use \"All\" special group to make the Project public;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Create A Sharing Group",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Sharing Groups are intended to collaborate with other Chorus users more easily.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_hbhernfmltnq-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Click “Create” button the top left;</span></li><li class=\"c0\"><span class=\"c5\">Select “Sharing group” from the drop down;</span></li></ol><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><p class=\"c1 c19 text-indent-zero\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 169.33px;\"><img alt=\"\" src=\"user-guide-images/image8.png\" style=\"width: 624.00px; height: 169.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_hbhernfmltnq-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">It will open a Create Sharing Group dialog window; </span></li><li class=\"c0\"><span class=\"c5\">Enter the name of your group;</span></li><li class=\"c0\"><span class=\"c5\">Invite people by typing their emails in the field ”Invite people personally”;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27 c50\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 468.30px; height: 384.50px;\"><img alt=\"\" src=\"user-guide-images/image33.png\" style=\"width: 468.30px; height: 384.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_hbhernfmltnq-0\" start=\"6\"><li class=\"c0\"><span class=\"c5\">Click “Create” button.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Now you can see your group under “My Groups” tab in the Sidebar.</span></p><p class=\"c1 c15\"><span class=\"c5\">Enter your Sharing Group’s name the next time you want to share data within your group.</span></p><p class=\"c1 c15\"><span>You can delete and edit your Sharing Group by selecting this group and using </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span>button. <br><br></span></p>"
                    }, {
                        "title": "Delete A Project",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Please Note:</span><span class=\"c5\">&nbsp;You can delete only private projects.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Important:</span><span class=\"c5\">&nbsp;If you delete your Project then all your experiments in scope of this project will be also removed.</span></p><ol class=\"c10 lst-kix_6bitq2nig7rf-0 start\" start=\"1\"><li class=\"c0\"><span>Select a Project you want to delete and click &nbsp;</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 37.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 37.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button;</span></li><li class=\"c0\"><span class=\"c5\">Select “Delete” from the drop-down menu;</span></li></ol><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><p class=\"c1 c19 text-indent-zero\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 164.00px;\"><img alt=\"\" src=\"user-guide-images/image39.png\" style=\"width: 624.00px; height: 164.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_6bitq2nig7rf-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">The confirmation dialog box will appear to prevent accidental deletion of Project;</span></li></ol><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><p class=\"c1 c19 text-indent-zero\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 290.67px;\"><img alt=\"\" src=\"user-guide-images/image158.png\" style=\"width: 624.00px; height: 290.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_6bitq2nig7rf-0\" start=\"4\"><li class=\"c0\"><span class=\"c5\">Click “Remove” button.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Experiment Wizard",
                        "content": "<p class=\"c1 c15\"><span>To open “Experiment Wizard” click &nbsp;</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 96.43px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image42.png\" style=\"width: 96.43px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">button on the top left and select “Experiment” from the drop down menu;<br></span></p><p class=\"c1 c19 text-indent-zero\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 133.33px;\"><img alt=\"\" src=\"user-guide-images/image57.png\" style=\"width: 624.00px; height: 133.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><p class=\"c1 c19 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_q4qve4rc1oxk-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c8\">General Info step:<br></span></li></ol><ol class=\"c10 lst-kix_q4qve4rc1oxk-1 start\" start=\"1\"><li class=\"c1 c22\"><span class=\"c5\">Provide general information about the experiment like experiment name, the project your experiment belongs to and the species;</span></li><li class=\"c1 c22\"><span class=\"c5\">Choose the Laboratory where your data was obtained;</span></li><li class=\"c1 c22\"><span class=\"c5\">Select the Instrument that produced the data;</span></li><li class=\"c1 c22\"><span class=\"c5\">Add description and include attachments if they are necessary;</span></li><li class=\"c1 c22\"><span class=\"c5\">Hit “Next” button to continue;<br></span></li></ol><p class=\"c27 c48\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 518.69px; height: 606.50px;\"><img alt=\"\" src=\"user-guide-images/image139.png\" style=\"width: 518.69px; height: 606.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_q4qve4rc1oxk-0\" start=\"2\"><li class=\"c0\"><span class=\"c9\">Files Selection Step:</span><span class=\"c5\"><br></span></li></ol><ol class=\"c10 lst-kix_q4qve4rc1oxk-1 start\" start=\"1\"><li class=\"c1 c22\"><span class=\"c5\">Select all the files that belong to your experiment. For convenience, you can use simple filters;</span></li><li class=\"c1 c22\"><span class=\"c5\">When the files are selected click “Next”;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 533.50px; height: 641.23px;\"><img alt=\"\" src=\"user-guide-images/image91.png\" style=\"width: 533.50px; height: 641.23px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To create a label free experiment without 2D/LC separation",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_uizhsnaebo30-0 start\" start=\"3\"><li class=\"c1 c36 c23\"><span class=\"c9\">Analysis Step:</span><span class=\"c5\"><br></span></li></ol><ol class=\"c10 lst-kix_uizhsnaebo30-1 start\" start=\"1\"><li class=\"c1 c22\"><span class=\"c5\">Specify the experiment type and hit “Next” to continue;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 531.56px; height: 613.50px;\"><img alt=\"\" src=\"user-guide-images/image82.png\" style=\"width: 531.56px; height: 613.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_giwdg7v0emv7-0 start\" start=\"4\"><li class=\"c0\"><span class=\"c9\">File-to-prep Step:</span><span class=\"c5\"><br></span></li></ol><ol class=\"c10 lst-kix_giwdg7v0emv7-1 start\" start=\"1\"><li class=\"c1 c22\"><span class=\"c5\">Specify Prep Name for each file. Prep is a mix of one or more samples that are run through the instrument;</span></li><li class=\"c1 c22\"><span class=\"c5\">Click “Next”; <br></span></li></ol><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 566.50px; height: 676.35px;\"><img alt=\"\" src=\"user-guide-images/image105.png\" style=\"width: 566.50px; height: 676.35px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_giwdg7v0emv7-0\" start=\"5\"><li class=\"c1 c36 c23\"><span class=\"c9\">Sample-to-Prep Step:</span><span class=\"c5\"><br></span></li></ol><ol class=\"c10 lst-kix_giwdg7v0emv7-1 start\" start=\"1\"><li class=\"c1 c22\"><span class=\"c5\">Specify Biological Samples to Prep Samples; </span></li><li class=\"c1 c22\"><span class=\"c5\">Click “Next” button;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span class=\"c9\">Please Note: </span><span class=\"c5\">Technical replicates should have the same values in the SAMPLE NAME column and biological replicates different.</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 564.27px;\"><img alt=\"\" src=\"user-guide-images/image1.png\" style=\"width: 624.00px; height: 564.27px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\"><br><br><br></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_giwdg7v0emv7-0\" start=\"6\"><li class=\"c0\"><span class=\"c9\">Experiment Design Step:</span><span class=\"c5\"><br></span></li></ol><ol class=\"c10 lst-kix_giwdg7v0emv7-1 start\" start=\"1\"><li class=\"c1 c22\"><span class=\"c5\">Add factors. Factors can be number based which means that their values contain units or they can be text based.</span></li><li class=\"c1 c22\"><span class=\"c5\">Click “Next” button;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c23\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 549.50px; height: 670.58px;\"><img alt=\"\" src=\"user-guide-images/image6.png\" style=\"width: 549.50px; height: 670.58px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_giwdg7v0emv7-0\" start=\"7\"><li class=\"c0\"><span class=\"c9\">Confirm Step:</span><span class=\"c5\"><br></span></li></ol><ol class=\"c10 lst-kix_giwdg7v0emv7-1 start\" start=\"1\"><li class=\"c1 c22\"><span class=\"c5\">Verify the details of your experiment;</span></li><li class=\"c1 c22\"><span class=\"c5\">Click “Confirm and Create”.</span></li></ol><p class=\"c27\"><span><br></span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 495.50px; height: 606.67px;\"><img alt=\"\" src=\"user-guide-images/image109.png\" style=\"width: 495.50px; height: 606.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\"><br></span></p><p class=\"c1 c15\"><span>After the experiment is created, your data can be processed and visually examined. For more details about data processing and visualisation see </span><span class=\"c45\"><a class=\"c6\" href=\"#h.bo1wld3poz4s\">Chapter 5</a></span><span>&nbsp;and </span><span class=\"c45\"><a class=\"c6\" href=\"#h.g7nwzcr7apyj\">Chapter 6</a></span><span>&nbsp;of this user’s manual.</span></p><hr style=\"page-break-before:always;display:none;\"><p></p>"
                    }, {
                        "title": "Copy, Editing, And Deleting Experiments",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Using context sensitive menu by pointing to the experiment you can copy, edit, or delete an experiment. </span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 304.00px;\"><img alt=\"\" src=\"user-guide-images/image35.png\" style=\"width: 624.00px; height: 304.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Search Database Upload",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Chorus can search through a database to identify proteins. In order to perform further analysis and processing of your data you can upload search database or use public databases that were uploaded by other Chorus users.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Please Note: </span><span class=\"c5\">Chorus accepts databases only in FASTA format (the standard format for popular public sequence databases). Make sure that *fasta file size does not exceed 100Mb. </span></p>"
                    }, {
                        "title": "To Upload Search Database",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_iv4bsxjmatm7-0 start\" start=\"1\"><li class=\"c0\"><span>Click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 96.43px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image42.png\" style=\"width: 96.43px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button and select “Search Database” from the drop down.</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 180.00px;\"><img alt=\"\" src=\"user-guide-images/image145.png\" style=\"width: 630.00px; height: 180.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\"><br></span></p><ol class=\"c10 lst-kix_iv4bsxjmatm7-0\" start=\"2\"><li class=\"c0\"><span class=\"c5\">It will open a dialog window where you need to enter database name, set species type and select database file with *.fasta extension;</span></li></ol><p class=\"c1\"><span><br></span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 605.50px; height: 472.87px;\"><img alt=\"\" src=\"user-guide-images/image41.png\" style=\"width: 605.50px; height: 472.87px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_iv4bsxjmatm7-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">Hit “Upload” button and the progress will begin;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">When upload process is completed this database will appear in the “My Search Databases” section of the sidebar. If you marked it to be public then it will also appear in “Public Search” section under “My Search Databases” and will be available for all Chorus users. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 666.60px; height: 300.50px;\"><img alt=\"\" src=\"user-guide-images/image92.png\" style=\"width: 666.60px; height: 300.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>You can make your database private at any time. Simply click on </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 28.46px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 28.46px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button and select “Make private”. Use the same procedure to make it public.<br></span></p><p class=\"c1 c50\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 647.50px; height: 192.19px;\"><img alt=\"\" src=\"user-guide-images/image106.png\" style=\"width: 647.50px; height: 192.19px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "To Edit Search Database",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">You can change species type and database name. To do this:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_9oyh17w65eyu-0 start\" start=\"1\"><li class=\"c1 c36 c23\"><span>Click on </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 28.46px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image7.png\" style=\"width: 28.46px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button and select “Edit”;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 172.00px;\"><img alt=\"\" src=\"user-guide-images/image30.png\" style=\"width: 630.00px; height: 172.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_9oyh17w65eyu-0\" start=\"2\"><li class=\"c1 c36 c23\"><span class=\"c5\">It will open a dialog window where you can make changes. To apply changes hit “Save” button;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 622.50px; height: 283.58px;\"><img alt=\"\" src=\"user-guide-images/image15.png\" style=\"width: 622.50px; height: 283.58px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }]
                },
                {
                    key: "results-visualization",
                    title: "Processing Result Visualization",
                    subtopics: [{
                        "title": "DataCube Visualization",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To get analysis results data you need to execute analysis pipeline:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_qbanhn7pkkoi-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Click “Get Data” button on the top left;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 126.67px;\"><img alt=\"\" src=\"user-guide-images/image21.png\" style=\"width: 630.00px; height: 126.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4 c61\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_qbanhn7pkkoi-0\" start=\"2\"><li class=\"c1 c36 c23\"><span class=\"c5\">It will open “Get Analysis Results Data” dialog window. Click on “Please specify the initial DataCube from \"Manage\" dialog” link;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c39\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 511.00px; height: 377.00px;\"><img alt=\"\" src=\"user-guide-images/image102.png\" style=\"width: 511.00px; height: 377.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\"><br></span></p><ol class=\"c10 lst-kix_qbanhn7pkkoi-0\" start=\"3\"><li class=\"c0\"><span class=\"c5\">Select initial DataCube and hit &nbsp;“Open”;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 547.50px; height: 399.22px;\"><img alt=\"\" src=\"user-guide-images/image97.png\" style=\"width: 547.50px; height: 399.22px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><ol class=\"c10 lst-kix_qbanhn7pkkoi-0\" start=\"4\"><li class=\"c1 c36 c23\"><span class=\"c5\">It will bring you back to “Get Analysis Results Data” dialog window. Click Next;</span></li></ol><p class=\"c1 c55\"><span><br></span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 507.00px; height: 375.00px;\"><img alt=\"\" src=\"user-guide-images/image70.png\" style=\"width: 507.00px; height: 375.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><ol class=\"c10 lst-kix_qbanhn7pkkoi-0\" start=\"5\"><li class=\"c1 c36 c23\"><span class=\"c5\">Specify Matrix to display and set filtering parameters. Click on “Save” button;</span></li></ol><p class=\"c27\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 519.50px; height: 470.85px;\"><img alt=\"\" src=\"user-guide-images/image186.png\" style=\"width: 519.50px; height: 470.85px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_qbanhn7pkkoi-0\" start=\"6\"><li class=\"c0\"><span>To execute analysis pipeline, click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 30.33px; height: 30.93px;\"><img alt=\"\" src=\"user-guide-images/image59.png\" style=\"width: 30.33px; height: 30.93px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button on the top left;</span></li></ol><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Analysis results can then be viewed and explored interactively using various Chorus viewers. &nbsp;</span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "General DataCube View",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">General DataCube View offers overviews and tools to help you make direct comparisons and analysis. Below you can find description of the features and tools available in this view. </span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">General DataCube View includes two interactive views: </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_mfcqsx81237e-0 start\"><li class=\"c1 c29\"><span class=\"c5\">Proteins/peptides/isotope groups/features list depending on previously selected DataCube in the left pane;</span></li><li class=\"c1 c29\"><span class=\"c5\">Corresponding matrix table in the right pane; &nbsp;</span></li></ul><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 497.27px;\"><img alt=\"\" src=\"user-guide-images/image11.png\" style=\"width: 624.00px; height: 497.27px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Tabular Viewer",
                        "content": "<p class=\"c1 c15\"><span class=\"c5\"><br>Tabular viewer displays various properties of objects such as peptides, proteins, features and isotope groups. You can remove or add columns so they will fit the problem under investigation.</span></p><p class=\"c1 c15\"><span class=\"c5\"><br>Tabular viewer columns can be sorted in ascending or descending way according to any property displayed in the table. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">To sort the table:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_7omgsk1tspur-0 start\"><li class=\"c0\"><span class=\"c5\">Click on the header of the corresponding column. Another click on the same column header reverts the sort direction.</span></li></ul><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">OR</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_7omgsk1tspur-0\"><li class=\"c0\"><span class=\"c5\">Right-click on the header of the corresponding column to open the drop down menu with sorting options.<br></span></li></ul><p class=\"c1 c15\"><span>Columns width is automatically adjusted for optimum viewing. Some data is very large to display, mousing over column headings and icons brings up Tool Tips. &nbsp;<br><br>To manage table settings refer to </span><span class=\"c45\"><a class=\"c6\" href=\"#h.1s94b1yi5il1\">Data Appearance Settings</a></span><span>&nbsp;section. </span><span class=\"c5\"><br></span></p>"
                    }, {
                        "title": "Heat Map",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Heat map is a useful tool for presenting mass spectrometry data organized in a matrix format. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Matrix is created by arranging the data such that each column contains the data from a single file and each row corresponds to a single feature (e.g. a spectrum, peptide, or protein). &nbsp;</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">A heat map performs two actions on a matrix. First, it reorders the rows and columns so that rows (and columns) with similar profiles are closer to one another, causing these profiles to be more visible to the eye. Second, each entry in the data matrix is displayed as a color, making it possible to view the patterns graphically. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">The Matrix Table includes a colored landscape, color coded according to the legend shown on the top of the Matrix table pane. Gray represents missing values. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>To manage matrix table settings refer to </span><span class=\"c45\"><a class=\"c6\" href=\"#h.1s94b1yi5il1\">Data Appearance Settings</a></span><span class=\"c5\">&nbsp;section. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Data Appearance Settings",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>To modify data appearance use </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 21.48px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image49.png\" style=\"width: 21.48px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button on the toolbar. It will open a dialog with two tabs. In General tab you can modify Matrix Table appearance and in Columns Tab you can manage columns.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c44\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 641.50px; height: 338.06px;\"><img alt=\"\" src=\"user-guide-images/image188.png\" style=\"width: 641.50px; height: 338.06px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span><br><br></span><span class=\"c9\">General Tab</span><span class=\"c5\"><br><br>Here you can:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ol class=\"c10 lst-kix_eqqel7pdla7m-0 start\" start=\"1\"><li class=\"c0\"><span class=\"c5\">Select matrix viewing mode;</span></li><li class=\"c0\"><span class=\"c5\">Select what data to display in matrix pane;</span></li><li class=\"c1 c36 c23\"><span class=\"c5\">Set color palette. &nbsp;The choice of color palette is largely personal preference. In order to maximize the ability to distinguish colors in midranges, using a light \"mid\" color may be preferable.</span></li></ol><p class=\"c1 c15\"><span class=\"c5\">&nbsp;</span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 576.50px; height: 421.86px;\"><img alt=\"\" src=\"user-guide-images/image147.png\" style=\"width: 576.50px; height: 421.86px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\"><br><br></span></p><p class=\"c1 c15 c4\"><span class=\"c8\"></span></p><p class=\"c1 c15\"><span class=\"c9\">Columns Tab</span><span><br><br>All tables include a large number of possible columns. You can hide/show columns in the </span><span class=\"c62\">protein, peptide, features and isotope groups</span><span class=\"c5\">&nbsp;lists. Go to Columns tab and select the columns you need to display.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 518.37px; height: 424.50px;\"><img alt=\"\" src=\"user-guide-images/image12.png\" style=\"width: 518.37px; height: 424.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Multiple Levels of Data Summarization",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c33\">Use “Manage” button to change visualized DataCube. The available choices of </span><span>pre build</span><span class=\"c5\">&nbsp;DataCubes will be listed in the “Analysis Management” dialog. &nbsp;</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 377.13px;\"><img alt=\"\" src=\"user-guide-images/image152.png\" style=\"width: 624.00px; height: 377.13px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">By switching to the “Analysis” or “Templates” tab you can select predefined analysis pipeline or template that can be run to perform analysis on the processing result DataCube.</span></p>"
                    }, {
                        "title": "To Display Protein Sequence",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Accession numbers option provides detailed information about any protein selected from the table. It helps you inspect and assess whether the selected protein identification appears meaningful or not.<br>Select identified protein in a table and click on </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 27.00px; height: 26.00px;\"><img alt=\"\" src=\"user-guide-images/image31.png\" style=\"width: 27.00px; height: 26.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;toolbar button. Dialog window will be opened where you can see the location of peptides in the protein sequence. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 316.00px;\"><img alt=\"\" src=\"user-guide-images/image122.png\" style=\"width: 630.00px; height: 316.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15\"><span class=\"c5\"><br>It displays the entire amino acid sequence for the protein selected in the table. Identified peptides are highlighted in yellow, while selected peptide is shown in red.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Above the sequence the protein accession number and selected peptide are shown together with the total number of found peptides. The sequence is derived from the fasta database that was selected before data processing. &nbsp;</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">A Tool Tip with selected peptide is available when you navigate the mouse over the protein sequence.</span></p>"
                    }, {
                        "title": "Zoom in into the data details",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Zoom in feature provides you with an ability to see identified proteins in more details. Selecting element in the tale and clicking</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 20.52px; height: 20.52px;\"><img alt=\"\" src=\"user-guide-images/image99.png\" style=\"width: 20.52px; height: 20.52px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;toolbar button will open a list with all peptides identified in the selected protein. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 612.69px; height: 187.50px;\"><img alt=\"\" src=\"user-guide-images/image148.png\" style=\"width: 612.69px; height: 187.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 148.27px;\"><img alt=\"\" src=\"user-guide-images/image149.png\" style=\"width: 624.00px; height: 148.27px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 131.40px;\"><img alt=\"\" src=\"user-guide-images/image150.png\" style=\"width: 624.00px; height: 131.40px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 236.20px;\"><img alt=\"\" src=\"user-guide-images/image151.png\" style=\"width: 624.00px; height: 236.20px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }, {
                        "title": "Chromatogram and Spectrum Viewers",
                        "content": "<p class=\"c1 c15\"><span>To display chromatogram and spectrum </span><span>use </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 21.38px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image111.png\" style=\"width: 21.38px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;toolbar button or just double click on the element in the table. Chromatogram and spectrum will appear to the left of matrix table. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 337.33px;\"><img alt=\"\" src=\"user-guide-images/image179.png\" style=\"width: 630.00px; height: 337.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\"><br><br>To the left of charts there is a pane with list of files that were used to plot chromatogram and spectrum. They can be plotted using all files or using average by condition option. This pane also provides information about the color assignment of each data file in the experiment.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">You can concentrate on certain parts of the chromatogram or spectra and manipulate them to improve the analysis of the results.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>To adjust size of all panes just </span><span class=\"c74\">set the pointer on the outer most border of the table then click and drag to make the table larger or smaller.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Chromatogram</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">The BPI &nbsp;(Base Peak Intensity) chromatogram is displayed on the top of the charts pane. Retention time is shown along the x-axis and relative intensity is shown along the y-axis. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">A single left click on a peak in the chromatogram generates a spectrum centered around the nearest peak. The vertical height at which the mouse is clicked is also taken into account, the peak chosen will be the nearest peak of equal or greater intensity.</span></p><p class=\"c1 c15\"><span class=\"c5\">A left mouse button click-and-drag operation generates a spectrum for the selected range. To manipulate the chromatogram use toolbar buttons on the top right of the chart.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c8\">Spectrum</span></p><p class=\"c1 c15\"><span class=\"c5\"><br>Spectrum chart is located under chromatogram. The x-axis represents m/z ratio and the y-axis represents relative intensity. The base peak is used to scale all other peaks accordingly. <br><br>A single left click on a peak in the spectrum generates a chromatogram centered around the nearest peak. The vertical height at which the mouse is clicked is also taken into account, the peak chosen will be the nearest peak of equal or greater intensity. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">A left mouse button click-and-drag operation generates a chromatogram for the selected range. To manipulate the spectra use toolbar buttons on the top right of the chart.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c27 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 478.50px; height: 447.09px;\"><img alt=\"\" src=\"user-guide-images/image161.png\" style=\"width: 478.50px; height: 447.09px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "MS2 data verification (DDA)",
                        "content": "<p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 309.67px;\"><img alt=\"\" src=\"user-guide-images/image162.png\" style=\"width: 624.00px; height: 309.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "Intensity viewer",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Intensity viewer plots a chart which illustrates factor-intensity dependence for the selected element in the table. </span></p><p class=\"c1 c15\"><span>To open intensity viewer select the element in the table and click on </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 29.00px; height: 27.00px;\"><img alt=\"\" src=\"user-guide-images/image20.png\" style=\"width: 29.00px; height: 27.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span>&nbsp;toolbar button. It will appear to the right of Matrix table. Here you need to select factor for x-axis. To set and re-order columns order use </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 26.85px; height: 22.50px;\"><img alt=\"\" src=\"user-guide-images/image24.png\" style=\"width: 26.85px; height: 22.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">button. In order to perform zoom in/out manipulations on chart use mouse scroll wheel.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c72\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 667.84px; height: 379.50px;\"><img alt=\"\" src=\"user-guide-images/image180.png\" style=\"width: 667.84px; height: 379.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p>"
                    }, {
                        "title": "Trend viewer",
                        "content": "<p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 624.00px; height: 398.07px;\"><img alt=\"\" src=\"user-guide-images/image163.png\" style=\"width: 624.00px; height: 398.07px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><hr style=\"page-break-before:always;display:none;\"><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p>"
                    }]
                },
                {
                    key: "analysis-framework",
                    title: "Analysis Framework",
                    subtopics: [{
                        "title": "Overview",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Chorus provides highly customizable workflows, allowing you to build pipelines using number of algorithms. Chorus pipelines are also fully customizable which allows you to select what algorithms and in what order to apply them to best meet your needs. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Data analysis using the pipeline lets you:</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><ul class=\"c10 lst-kix_32xpggq3h43k-0 start\"><li class=\"c0\"><span class=\"c5\">Simplify procedures and reduce errors</span></li><li class=\"c0\"><span class=\"c5\">Standardize and reproduce analyses</span></li></ul><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Pipeline jobs are defined as a sequence of algorithms, run in a specified order. </span></p>"
                    }, {
                        "title": "Creating Pipeline",
                        "content": "<p class=\"c1 c15\"><span>To create analysis pipeline on Chorus use </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 28.95px; height: 26.32px;\"><img alt=\"\" src=\"user-guide-images/image53.png\" style=\"width: 28.95px; height: 26.32px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button that is located next to initial DataCube title. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 324.00px;\"><img alt=\"\" src=\"user-guide-images/image117.png\" style=\"width: 630.00px; height: 324.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">This will open Add Algorithm dialog where you need to select an appropriate algorithm to apply. Click on algorithm type, select the one you need from the drop down and click “Next” button.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 612.50px; height: 388.89px;\"><img alt=\"\" src=\"user-guide-images/image51.png\" style=\"width: 612.50px; height: 388.89px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 610.50px; height: 384.71px;\"><img alt=\"Screen Shot 2016-12-28 at 6.17.50 PM.png\" src=\"user-guide-images/image86.png\" style=\"width: 610.50px; height: 386.84px; margin-left: 0.00px; margin-top: -1.07px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Depending on selected algorithm you will then need to choose a Matrix to apply the algorithm, set values where applicable or check the necessary checkboxes. After you done with entering required parameters click “Apply” button. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c59\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 597.17px; height: 336.50px;\"><img alt=\"\" src=\"user-guide-images/image19.png\" style=\"width: 597.17px; height: 336.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">The algorithm will appear next to DataCube title. </span></p><p class=\"c1 c15\"><span>&nbsp;</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 326.67px;\"><img alt=\"\" src=\"user-guide-images/image80.png\" style=\"width: 630.00px; height: 326.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">You can add as many algorithms as you like, thus creating a pipeline. </span></p><p class=\"c1 c15\"><span>To run a pipeline simply click on </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 28.14px; height: 28.70px;\"><img alt=\"\" src=\"user-guide-images/image59.png\" style=\"width: 28.14px; height: 28.70px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button. </span></p>"
                    }, {
                        "title": "Pipeline Template",
                        "content": "<p class=\"c1 c15\"><span class=\"c5\">After setting up the desired pipeline, you can save it for future use. Click the “Save” button at the top right of the window. It will open a “Save Analysis” dialog window where you need to type a name, mark “Is template” checkbox and save the changes by clicking “Save” button. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 332.00px;\"><img alt=\"\" src=\"user-guide-images/image135.png\" style=\"width: 630.00px; height: 332.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Any templates that are saved will be available in “Analysis Management” dialog. Click “Manage” on the top right and go to Templates tab. Here you can select previously saved template and apply it to DataCube. </span></p>"
                    }, {
                        "title": "R and Python plug-ins",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Script console is a tool to extend Chorus functionality by executing programs which are called scripts. Chorus script console supports R and Python scripting languages. </span></p><p class=\"c1 c15\"><span>To open a script console go to “Add Algorithm” dialog by pressing </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 25.50px; height: 23.50px;\"><img alt=\"\" src=\"user-guide-images/image53.png\" style=\"width: 25.50px; height: 23.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;button. Open “Analysis” tab and select Python or R script. </span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 330.67px;\"><img alt=\"\" src=\"user-guide-images/image95.png\" style=\"width: 630.00px; height: 330.67px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">Here you can select script to execute from existing ones or create new.</span></p><p class=\"c1 c44\"><span>&nbsp;</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 277.33px;\"><img alt=\"\" src=\"user-guide-images/image66.png\" style=\"width: 630.00px; height: 277.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c4 c44\"><span class=\"c5\"></span></p><p class=\"c1 c4 c44\"><span class=\"c5\"></span></p><p class=\"c1 c4 c44\"><span class=\"c5\"></span></p><p class=\"c1 c44\"><span class=\"c5\">“Create new” button opens a dialog window where you can create and save your own script and then run it to perform analysis on the processing result DataCube.</span></p><p class=\"c1 c4 c44\"><span class=\"c5\"></span></p><p class=\"c27 c44\"><span>&nbsp;</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 546.50px; height: 669.68px;\"><img alt=\"\" src=\"user-guide-images/image84.png\" style=\"width: 546.50px; height: 669.68px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c27 c4 c44\"><span class=\"c5\"></span></p><p class=\"c1 c44\"><span>After writing or selecting script, click Save and apply button. In order to execute script click on </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 20.00px; height: 20.40px;\"><img alt=\"\" src=\"user-guide-images/image59.png\" style=\"width: 20.00px; height: 20.40px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span>button.</span></p><h3 class=\"c24 c25\" id=\"h.efgy88sox3fe\"><span class=\"c13 c9\"></span></h3><hr style=\"page-break-before:always;display:none;\"><h3 class=\"c24 c25\" id=\"h.yjad2y9bh52\"><span class=\"c13 c9\"></span></h3>"
                    }, {
                        "title": "Pipelines execution",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Pipeline execution can be performed in manual and in automated way. Below you can find description of available modes. To enable one or another mode use</span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 91.03px; height: 20.00px;\"><img alt=\"\" src=\"user-guide-images/image108.png\" style=\"width: 91.03px; height: 20.00px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp; buttons on the top right.</span></p><p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c50\"><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 630.00px; height: 93.33px;\"><img alt=\"\" src=\"user-guide-images/image69.png\" style=\"width: 630.00px; height: 93.33px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span></p><p class=\"c1 c15\"><span>&nbsp;</span></p>"
                    }, {
                        "title": "Manual",
                        "content": "<p class=\"c1 c15 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span>Manual pipeline execution mode is enabled by default. This means that you decide when analysis pipeline will be executed. &nbsp;After adding/editing algorithms or selecting another type of DataCube you need to click </span><span style=\"overflow: hidden; display: inline-block; margin: 0.00px 0.00px; border: 0.00px solid #000000; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px); width: 22.06px; height: 22.50px;\"><img alt=\"\" src=\"user-guide-images/image59.png\" style=\"width: 22.06px; height: 22.50px; margin-left: 0.00px; margin-top: 0.00px; transform: rotate(0.00rad) translateZ(0px); -webkit-transform: rotate(0.00rad) translateZ(0px);\" title=\"\"></span><span class=\"c5\">&nbsp;in order to run pipeline execution and display the results. </span></p>"
                    }, {
                        "title": "Auto",
                        "content": "<p class=\"c1 c4\"><span class=\"c5\"></span></p><p class=\"c1 c15\"><span class=\"c5\">If Auto mode is enabled then analysis pipeline will be executed after any change you applied. </span></p>"
                    }]
                }
            ];
            var topicsMap = {};
            topics.forEach(function (t) {
                topicsMap[t.key] = t;
            });

            var allSubtopics = [];
            topics.forEach(function (t) {
                Array.prototype.push.apply(allSubtopics, t.subtopics);
            });

            return {
                topics: topics,
                topicsMap: topicsMap,
                allSubtopics: allSubtopics
            };
        });

})();
